INSERT INTO `channels` (`id`, `channelid`, `channelname`, `channelnumber`, `channeltag`, `channellogo`, `channelurl`, `description`, `genre_id`, `active`, `date_created`, `date_updated`) VALUES
(1, '0c517c3a-93b6-402f-9236-428b8e04ba3d', 'Crime + Investigation', '170', 'I26', 'http://rndcdn.dstv.com/dstvcms/2016/06/14/DStvNowApp_CrimeInvestigation_new4-4logo_002_xlrg.png', 'http://www.crimeandinvestigation.co.uk/', 'The only channel dedicated to true crime stories, CI will take you on a journey deep into the heart of the criminal underworld, exploring the minds and methods of both criminal and detective.', 3, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(2, '486b8b7e-eb94-4b47-bfd3-30d1d9675a23', 'People’s Weather', '180', 'WEA', 'http://cdn.dstv.com/www.dstv.com/dstvchannels/NowLogos/Weather_small.png', 'http://www.peoplesweather.com/', 'The Weather Channel now offers a video forecast with various weather information as well as the interactive application for detailed information on South Africa, Africa and the rest of the world.', 3, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(3, '6c949e76-9cf2-4110-bb28-c28b41124a15', 'National Geographic', '181', 'NA8', 'http://rndcdn.dstv.com/dstvcms/2016/11/15/NationalGeographic_new4-4logo-for-dark_xlrg.png', 'http://natgeotv.com/za', 'With unrivalled quality and spectacular imagery, this channel brings you award-winning documentaries from around the world - from wildlife adventure and exploration to natural phenomena and world cultures.', 3, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(4, '962b202c-d394-4459-a084-f31fcb43c478', 'Nat Geo Wild', '182', 'NGW', 'http://rndcdn.dstv.com/dstvcms/2016/08/15/DStv_NatGeoWild_new4-4logo-dark_001_xlrg.png', 'http://natgeotv.com/za', 'This 24 hour channel from the National Geographic stable, is dedicated to the best in wildlife programming, the power of mother nature and the future of our planet', 3, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(5, 'cb0d5aba-2af9-43bd-a313-2f8a6267f642', 'Animal Planet', '183', 'ANK', 'http://cdn.dstv.com/www.dstv.com/dstvchannels/NowLogos/animal_planet_sml.png', 'http://animal.discovery.com/', 'Animal Planet, a major channel of the Discovery network\'s portfolio, offers intrigue, adventure,<br>humour, relationships, life and death. It\'s television that Grabs You!<br>', 3, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(6, '83f17af2-3e90-4971-9145-b7b5ef07377d', 'BBC Earth', '184', 'ETH', 'http://cdn.dstv.com/www.dstv.com/dstvchannels/NowLogos/BBCEarth_small.png', NULL, 'BBC Earth inspires audiences by sharing the incredible wonders of our universe. The channel showcases the work of the world’s foremost factual film makers as it seeks to take audiences on a thrilling journey of discovery. From the smallest creature under the microscope to the limitless expanses of space, BBC Earth brings viewers face to face with heart pounding action, mind blowing ideas and the wonder of being human.', 3, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(7, '8f90ebcd-3b26-4ccf-b857-c6206f7d73f2', 'HISTORY', '186', 'H23', 'http://cdn.dstv.com/www.dstv.com/dstvchannels/NowLogos/history_sml2.png', 'http://historytv.co.za/', 'HISTORY is a factual entertainment channel bursting with characters sharing their stories from the past and present; where limits are pushed to the extreme, negotiations are won and facts discovered.', 3, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(8, 'b92237a0-e3b9-4400-b7af-7e0386066277', 'Ignition', '189', 'ITV', 'http://cdn.dstv.com/www.dstv.com/dstvchannels/NowLogos/ignition_small_2.png', 'http://www.ignitiontv.co.za/', 'New models, old bangers, supercars or classics, hot rods and pimped up racers – if you’re crazy about cars SA’s only motoring channel will get your  engine running.', 3, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(9, '3fda797c-54ea-434d-8bf1-8ce583c2a8b8', 'DStv Explora Tutorials', '197', 'B24', 'http://rndcdn.dstv.com/dstvcms/2016/11/30/dstv_4x4_xlrg.png', NULL, 'The new DStv Explora: find everything you need to know - from connecting your DStv Explora to the internet to accessing DStv Catch Up and doing remote recordings.', 3, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(10, 'eab73dde-155e-4515-a706-6d1324f9084b', 'M-Net', '101', 'HDT', 'http://rndcdn.dstv.com/dstvcms/2016/06/14/DStvNowApp_M-Net_new4-4logo_xlrg.png', 'http://mnet.dstv.com/', 'M-Net (Channel 101) is your channel to connect with the very best in television entertainment. Experience the latest blockbuster movies, gripping international series and highly acclaimed local shows in one magical destination, M-Net, Where Magic Lives.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(11, 'ce8fb703-6ba0-4143-872b-d3366dd7569e', 'M-Net Edge', '102', 'M11', 'http://rndcdn.dstv.com/dstvcms/2016/06/14/DStvNowApp_M-NetEdge_new4-4logo_xlrg.png', NULL, 'M-Net EDGE takes you to the very edge of entertainment with a bold channel that will add a whole new dimension to your TV viewing and give it a shakeup.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(12, '2a094aeb-1f47-44c5-abfe-056ad928db8c', 'Vuzu AMP', '103', 'VAM', 'http://rndcdn.dstv.com/dstvcms/2016/08/15/DStv_VuzuAmp_new4-4logo-dark_001_xlrg.png', 'http://vuzu.dstv.com/', 'An amplified TV experience with the best in international and local series. It\'s out of this world television. #VuzuAmp', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(13, 'd7197942-ef3b-4533-a7ed-1d26f41b9d46', 'M-Net Movies Premiere', '104', 'M1D', 'http://rndcdn.dstv.com/dstvcms/2016/07/01/DStv_M-Net-Movies-Premiere_new4-4logo_002_xlrg.png', 'http://mnetmovies.dstv.com/', 'The crème-de-la-crème of big budget, hit movies await on the M-Net Movies Premiere channel. This is where Hollywood royalty lives and where you can find the freshest movies appearing on TV for the first time. Movies will be screened first on this channel before moving to the relevant themed channel.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(14, '85ddeeb9-6508-4270-a9b9-cfa247b7021e', 'M-Net Movies Smile', '105', 'MCH', 'http://rndcdn.dstv.com/dstvcms/2016/07/01/DStv_M-Net-Movies-Smile_new4-4logo_xlrg.png', 'http://mnetmovies.dstv.com/', 'M-Net Movies Smile is the channel guaranteed to make you show your pearly whites. Everyone who\'s young at heart can look forward to fantastic animated and family-friendly films as well as sidesplitting comedy for grown-ups.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(15, 'a4ec39ad-9b0f-44cb-bc4b-672d0a005405', 'M-Net Movies Action+', '106', 'MAP', 'http://rndcdn.dstv.com/dstvcms/2016/06/21/DStvNowApp_M-NetMoviesActionPlus_new4-4logo_xlrg.png', 'http://mnetmovies.dstv.com/', 'Escape on an adventure, discover what lies in the far reaches of Space, fight the bad guys and save the world. M-Net Movies Action+ will take you there with a host of blockbuster movies from Action to Westerns, Horror and Sci-Fi.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(16, '5b4d0937-f221-4ed0-8f3b-b17f6d681278', 'M-Net Movies Showcase', '107', 'MSH', 'http://rndcdn.dstv.com/dstvcms/2016/07/01/DStv_M-Net-Movies-Showcase_new4-4logo_xlrg.png', 'http://mnetmovies.dstv.com/', 'Revisit your most magical movie moments and discover new ones with the Showcase channel. M-Net Movies shines the spotlight on specific movies and directors with exciting festivals, themes and box sets. Plus you get to take control with viewers’ choices.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(17, 'f2dd3961-450b-4328-acd2-9dad64f1107f', 'M-Net Movies Action', '110', 'MDH', 'http://rndcdn.dstv.com/dstvcms/2016/06/14/DStvNowApp_M-NetMoviesAction_new4-4logo_xlrg.png', 'http://mnetmovies.dstv.com/', 'Do high speed car chases, massive explosions, hot women, ripped action stars and giant bloodthirsty mutant animals make your world go round? With the M-Net Movies Action channel you’ll find everything to keep you glued to your lazy boy.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(18, '1699cd01-cebe-4f7f-836e-971ec34dbd62', 'M-Net Movies All Stars', '111', 'S30', 'http://rndcdn.dstv.com/dstvcms/2016/07/01/DStv_M-Net-Movies-AllStars_new4-4logo_xlrg.png', 'http://mnetmovies.dstv.com/', 'Your best loved actors and movies shine brightly on M-Net Movies All Stars. Featuring cult classics and movie favourites from past and present across a variety of genres from comedy to drama and romance, it’s the channel for young and old alike.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(19, '6975a820-fd26-4af1-87f6-2de70f5d76a3', 'Studio Universal', '112', 'SUH', 'http://cdn.dstv.com/www.dstv.com/dstvchannels/NowLogos/StudioUniver_small.png', 'http://www.facebook.com/StudioUniversalAfrica', 'Studio Universal is the top quality Hollywood movie destination, offering a wide choice of action, comedy and family movies for everyone to enjoy. We bring Hollywood into your home.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(20, 'c3c206c4-649d-4c32-aa40-4cba50e15836', 'Zee Bollywood Movies', '114', 'T66', 'http://rndcdn.dstv.com/dstvcms/2017/02/20/BollywoodMovies_new4-4logo-for-light_xlrg.png', NULL, 'A Bollywood movie channel offering a mix of classic and contemporary movies dubbed in English - expect it all: melodrama, dance, music and fashion.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(21, 'e92fa1c7-79b5-4bbc-a276-0522f73b06ec', 'M-Net City', '115', 'MFH', 'http://rndcdn.dstv.com/dstvcms/2016/08/15/DStv_M-NetCity_new4-4logo-dark_001_xlrg.png', NULL, 'A general entertainment channel showcasing the best international content, focusing on scripted drama, comedy and talk.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(22, '36d68fa7-c585-4bef-9302-53479012702c', 'Vuzu', '116', 'V30', 'http://rndcdn.dstv.com/dstvcms/2016/08/15/DStv_Vuzu_new4-4logo-dark_002_xlrg.png', 'http://vuzu.dstv.com/', 'Vuzu is a youth focused entertainment channel for young Africans. The programming is a combination of big name international series and locally produced shows. The channel features a wide variety of genres including drama, reality and comedy.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(23, '6d11af4a-5c31-407c-90d1-e0468b8f625b', 'Universal Channel', '117', 'UHD', 'http://cdn.dstv.com/www.dstv.com/dstvchannels/NowLogos/Universal_small.png', 'http://www.universalchannel.co.za/', 'Universal Channel Africa compels audiences with engaging, high-quality character-driven entertainment', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(24, '0c2d6148-1fb0-46fd-957f-b47eb4689bfb', 'Telemundo', '118', 'TEL', 'http://rndcdn.dstv.com/dstvcms/2016/06/14/DStvNowApp_Telemundo_new4-4logo_xlrg.png', 'http://msnlatino.telemundo.com/', 'Telemundo is a 24-hour Telenovela channel offering a wide range of themes for the whole family to enjoy including: traditional romance stories, mystery, action & adventure and stories based on real-life events with high quality production values and featuring top talent form the Telenovela industry.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(25, '85e9996c-29e8-45d2-a45b-a5e8a266fe92', 'BBC First', '119', 'B23', 'http://rndcdn.dstv.com/dstvcms/2016/06/14/DStvNowApp_BBCFirst_new4-4logo_001_xlrg.png', NULL, 'BBC First is the home of the very best original, innovative British drama and comedy - unique characters and unforgettable stories. The channel is available in SA only, 6-8 hours a day, commencing at 18:00 CAT daily.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(26, 'd38465be-4ee2-4e47-a002-37dca48d7c21', 'BBC Brit', '120', 'BBE', 'http://rndcdn.dstv.com/dstvcms/2016/06/14/DStvNowApp_BBCBrit_new4-4logo_xlrg.png', 'http://www.bbcsouthafrica.com/', 'BBC Brit offers premium factual entertainment that is intelligent but irreverent. Male-skewing but with broader appeal, it blends expertise with entertainment and fact with fun. The channel will be the exclusive home of Top Gear and covers a rich variety of subjects: cars, science, adventure, business, food, life-changing moments, extreme characters, quirky eccentrics and comedy. It is the perfect place to learn and laugh at the hands of some of the most endearing and quirky characters on television.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(27, 'a2301f0d-e517-4b15-a3cc-0086b1689e26', 'Discovery Channel', '121', 'DHD', 'http://cdn.dstv.com/www.dstv.com/dstvchannels/NowLogos/Discovery_small.png', 'https://www.facebook.com/DiscoveryChannelSouthAfrica', 'Discovery Channel offers viewers the finest in non-fiction entertainment in the areas of history, nature, science & technology, world class culture and human adventure.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(28, '988771b3-4bc4-4f22-886d-8f29ac9d2bba', 'Comedy Central', '122', 'CC7', 'http://cdn.dstv.com/www.dstv.com/dstvchannels/NowLogos/ComedyCentral_small.png', 'http://www.comedycentralafrica.com', 'Comedy Central is the first 24-hour comedy channel for sub-Saharan Africa, combining international comedy programming with locally produced content.<br>', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(29, 'f1713a44-62c0-44b5-9c56-d76929da7115', 'ITV Choice', '123', 'ITH', 'http://rndcdn.dstv.com/dstvcms/2016/06/14/DStvNowApp_ITVChoice_new4-4logo_001_xlrg.png', NULL, 'ITV Choice is the home of great British entertainment showcasing a wide variety of fresh from the UK award-winning drama, top entertainment and soaps. Be prepared to laugh, cry and everything in-between.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(30, '1ec7baa9-525d-49ed-9921-074caef44b02', 'FOX', '125', 'FHD', 'http://rndcdn.dstv.com/dstvcms/2016/08/15/DStv_FOX_new4-4logo_001_xlrg.png', 'www.foxafrica.com', 'FOX is a general entertainment channel designed for an audience 18-35 years, early adopter, urban and looking for something new, bold and innovative, offering the best international fiction series of the moment, including quality drama, comedy and entertainment programming.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(31, 'c84d4526-f10f-436b-af62-92fc0a4f1744', 'FOX Life', '126', 'FOC', 'http://rndcdn.dstv.com/dstvcms/2016/09/29/DStv_FoxLife_new4-4logo-dark_xlrg.png', NULL, 'FOX Life is primarily an entertainment channel featuring a mix of scripted and non-scripted aspirational entertainment programming.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(32, 'cbc8e8f1-75c3-4c0d-8bee-61b78b03ce0b', 'SONY', '127', 'SEK', 'http://cdn.dstv.com/www.dstv.com/dstvchannels/NowLogos/sony_sml.png', 'http://www.settv.co.za/', 'Sony Entertainment Television is the ultimate destination for complete family-friendly entertainment with mix of programming that includes captivating dramas, witty comedies and gripping thrillers.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(33, 'c4317471-61fd-4ef9-8a84-4ec4d6a08bcc', 'SONY MAX', '128', 'SMX', 'http://cdn.dstv.com/www.dstv.com/dstvchannels/NowLogos/SonyMax1_small.png', 'http://www.sonymax.co.za/', 'Sony Max is a channel made for men. It\'s an upfront bold channel, offering addictive programming.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(34, '229ec623-f220-40fa-a9e0-0c237ff00d3f', 'BET', '129', 'BE2', 'http://rndcdn.dstv.com/dstvcms/2016/08/15/DStv_BET_new4-4logo-dark_001_xlrg.png', 'http://guide.dstv.com/channels', 'Be first to see the best in urban culture entertainment including fresh international and local drama, reality, chat shows, awards shows, music specials, documentaries and more.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(35, '843a8588-5902-478a-a933-c4db3bc5c715', 'MTV', '130', 'MTV', 'http://cdn.dstv.com/www.dstv.com/dstvchannels/NowLogos/Mtv_small.png', 'http://www.mtv.co.za/', 'MTV is the world’s premier youth entertainment brand, the cultural home of the millennial generation, music fans, artists, and a pioneer in creating innovative programming for young people. MTV reflects and creates pop culture with its award-winning content built around compelling storytelling, music discovery and activism across TV, online and mobile.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(36, '61d34969-2deb-4bc3-a1e9-97ff46c207a0', 'Lifetime', '131', 'LTE', 'http://rndcdn.dstv.com/dstvcms/2016/06/14/DStvNowApp_Lifetime_new4-4logo_001_xlrg.png', 'https://www.facebook.com/LifetimeAfrica/', 'Lifetime is a brand new entertainment channel dedicated to providing quality scripted dramas, distinctive factual entertainment and feature length Lifetime Original Movies, with a host of A-list talent in front of and behind the camera.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(37, 'ad7d7c39-b3eb-4ce0-b303-d26ab84db6ab', 'CBS Reality', '132', 'RTK', 'http://cdn.dstv.com/www.dstv.com/dstvchannels/NowLogos/CBS_Reality_Small.png', 'http://cbsreality.tv/eu/', 'CBS Reality opens your eyes to the weird and wonderful sides of life, as well as the extraordinary moments which transform the everyday.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(38, 'd24854f2-70a5-4719-953b-230f33cd3747', 'TLC Entertainment', '135', 'DLC', 'http://cdn.dstv.com/www.dstv.com/dstvchannels/NowLogos/TLC_Small.png', 'https://www.facebook.com/TLCAfrica', 'TLC Entertainment is the brand new flagship entertainment and lifestyle network, offering a wide variety of inspirational and uplifting programming that reflects the multifaceted lives of today’s woman. Featuring content focused on real reality and m', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(39, 'b0c101c4-3139-48d8-885b-bf8a246b70c8', 'Discovery Family', '136', 'DIW', NULL, NULL, 'Premium programming for the whole family with glossy documentaries about the world we live in and beyond; from awesome space adventures to crazy experiments of popular science. Be transfixed by the big cats of Africa and the stories of animals that need rescuing or medical help. But you can also sit back and be entertained by hilarious clip based shows. Plus each morning there is a dedicated kids block to keep the little ones happy. It’s learning in the Discovery Way, always fun, inclusive and fascinating.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(40, '70ddb17d-a032-4c85-8418-06ad107cc340', 'TCM', '137', 'TC8', 'http://rndcdn.dstv.com/dstvcms/2017/01/19/TCM_new4-4logo-for-dark_xlrg.png', 'http://www.tcmafrica.com/', 'TCM Powered by Movies. Dedicated to American movie fans in Africa, the channel offers up-to-date qualitative blockbusters references that triggers viewer’s emotions.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(41, 'a0e986c2-9734-480f-981b-1f7c18852728', 'M-Net Movies Zone', '139', 'MMZ', 'http://rndcdn.dstv.com/dstvcms/2016/08/15/DStv_M-Net-Movies-Zone_new4-4logo-dark_001_xlrg.png', 'http://mnetmovies.dstv.com/#/Home/All', 'Featuring an exciting mixed bag of content from dramas, comedies and family movies, to something that will satisfy the action buffs. Zone treats viewers to a wide range of well-loved stars and movies from recent years.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(42, '26f1066c-4498-47f4-be01-8dfe75a9d4f9', 'EVA English', '141', 'EV1', 'http://rndcdn.dstv.com/dstvcms/2016/06/23/DStv_Eva_new4-4logo_xlrg.png', NULL, 'Eva is the home of the very best in first run contemporary telenovelas from Latin America, and around the world. Bold, romantic and bursting with passion, Eva is a television destination for modern viewers who enjoy their life with added spice!\r\nThe channel offers a potent mix of love, jealousy and betrayal in the shape of high quality serial dramas featuring the most established Latin stars – 24 hours a day. \r\nOwned and operated by leading international broadcaster AMC Networks International – Zone, Eva is available exclusively within Africa, and celebrates telenovelas fully dubbed into English and Brazilian Portuguese.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(43, 'abe5994d-189a-40be-b51d-b15369e4bde7', 'kykNET', '144', 'KHD', 'http://rndcdn.dstv.com/dstvcms/2016/06/14/DStvNowApp_Kyknet_new4-4logo_001_xlrg.png', 'http://kyknet.dstv.com/', 'If Afrikaans is your home language or even your second language, here\'s a television channel with REAL local flavour. Its called kykNET, its produced by M-Net, and it broadcasts only in Afrikaans. Programming includes everything from talk shows, to variety and music programmes, the best in local dramas and cooking shows.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(44, '5125cb0e-a0ee-4380-9697-8d4eb2c5c718', 'kykNET & Kie', '145', 'K30', 'http://cdn.dstv.com/www.dstv.com/dstvchannels/NowLogos/KykNET&Kie_small.png', 'http://kyknet.dstv.com/', 'kykNET & kie is an Afrikaans General Entertainment channel that consists of previously seen kykNET favourites that include lifestyle programmes and magazine shows. kykNET & kie also simulcasts some programmes from kykNET channel 144 and offers Afrikaans children’s programming previously seen on Koowee.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(45, 'dcfa84d3-5c6b-4448-9dd0-a5925c315478', 'kykNET Nou!', '146', 'KNM', 'http://rndcdn.dstv.com/dstvcms/2016/08/15/DStv_kyknetNou_new4-4logo-dark_001_xlrg.png', 'http://kyknet.dstv.com/', 'kykNET Nou! is an adult contemporary music channel, that will feature popular Afrikaans commercial artists and their music, featured music blocks, various music request and chart shows as well as related magazine shows.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(46, '9908da19-b506-44d5-92c6-64ab5ca05ae5', 'AfricaMagic Epic', '152', 'IA9', 'http://rndcdn.dstv.com/dstvcms/2016/10/20/Africa-Magic-Epic_new4-4logo_xlrg.png', 'http://africamagic.dstv.com/', 'Rooted in culture, AfricaMagic Epic is a channel dedicated to African programming made by Africans and features the best of epic entertainment content from the continent.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(47, 'a17405a4-7f2b-4366-8983-b93a0b47ee88', 'Africa Magic Urban', '153', 'AMM', 'http://rndcdn.dstv.com/dstvcms/2016/10/20/AfricaMagic_Urban_new4-4logo_xlrg.png', NULL, 'On AfricaMagic Urban, Africa’s bustling and growing cities provide the busy urban backdrop for the dynamic stories of modern life and love showcased on this 24-hour dedicated movie channel. From dramas to comedies, action to romance, it’s non-stop African movie entertainment showcasing real life and real stories.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(48, 'abc333b6-5ec5-43f6-bf76-9aaa770ae991', 'Africa Magic Family', '154', 'AFM', 'http://rndcdn.dstv.com/dstvcms/2016/10/20/AfricaMagic-Family_new4-4logo_Light_xlrg.png', 'http://africamagic.dstv.com/', 'You can expect to come home to family with the AfricaMagic Family channel.  An entertainment channel dedicated to African programming made by Africans, AfricaMagic Family provides family themed content comprising captivating dramas, sitcoms, shows and must watch series.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(49, 'afbb1167-e8e8-496e-9a18-2447f926424c', 'AfricaMagic World', '155', 'WAM', 'http://rndcdn.dstv.com/dstvcms/2016/10/20/AfricaMagic_World_new4-4logo_xlrg.png', 'http://africamagic.dstv.com/', 'AfricaMagic World is a variety channel packaged with the best of local productions which tell a world of stories from the African continent.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(50, 'aaf361f5-876e-403c-a540-0f12829d740c', 'SABC Encore', '156', 'SA4', 'http://cdn.dstv.com/www.dstv.com/dstvchannels/NowLogos/SABCEncore_small.png', NULL, 'Best of SABC golden oldies shows, including talk shows, drama, reality, sitcoms, children\'s programming and gospel.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(51, 'eb295b07-50c5-472a-9540-7379c31bc78a', 'Mzansi Magic', '161', 'MZH', 'http://rndcdn.dstv.com/dstvcms/2016/07/01/DStv_Mzansi-Magic_new4-4logo-light_xlrg.png', 'http://mzansimagic.dstv.com/', 'Mzansi Magic is M-Net’s new proudly South African entertainment channel. The channel will broadcast the very best South African and international feature films, bubblegum movies, short films, documentaries, music specials and talk shows.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(52, '93dd9f38-af95-47c7-a09e-e17f9c81fd9f', 'M-Net Family', '162', 'M30', 'http://rndcdn.dstv.com/dstvcms/2016/08/15/DStv_M-NetFamily_new4-4logo_001_xlrg.png', NULL, 'M-Net Family is packed with a variety of high quality international content - from drama and reality series to movies - while some hit local shows and a kiddies programming block also form part of the great family buffet of entertainment.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(53, '2b892f4a-9151-4c02-b6e3-d6dd4eefa866', 'Mzansi Wethu', '163', 'W30', 'http://rndcdn.dstv.com/dstvcms/2016/08/15/DStv_MzansiWethu_new4-4logo_001_xlrg.png', 'http://mzansimagic.dstv.com/', 'Mzansi Wethu is a locally focused general entertainment channel. The channel will broadcast game shows, a soap, bubblegum movies and reality shows. The programs reflect the day to day reality of South Africans.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(54, '456d08f5-13d0-4dfa-a9b5-a7aa084ee8cc', 'Mzansi Bioskop', '164', 'MZB', 'http://rndcdn.dstv.com/dstvcms/2016/08/15/DStv_MzansiBioskop_new4-4logo_001_xlrg.png', 'http://mzansimagic.dstv.com/', 'Mzansi Bioskop is the home of original African storytelling. The channel will broadcast bubblegum movies 24hours a day. The programs reflect the day to day reality of South Africans', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(55, '98c826a2-e96c-4a6d-8b23-6be50e1b3bcc', 'Ebony Life TV', '165', 'EBL', 'http://cdn.dstv.com/www.dstv.com/dstvchannels/NowLogos/EbonyLife_small.png', 'http://ebonylifetv.com/', 'EbonyLife is an entertainment channel that is going to change Africa forever. Inspiring Africans to elevate themselves to succeed on a global stage. Telling compelling and engaging stories of the people on the continent with heart, understanding and compassion. Universally human stories with a global black attitude. From human drama, insightful and relevant talk, to world class reality shows, EbonyLife is the authority on lasting entertainment.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(56, '711825eb-72b1-4e8e-9c3f-362f6eb011b4', 'Zee World', '166', 'ZEW', 'http://rndcdn.dstv.com/dstvcms/2016/06/14/DStvNowApp_ZeeWorld_new4-4logo_xlrg.png', NULL, 'Zee World brings you the best blockbuster movies and series from Bollywood. With award-winning dramas, nail-biting reality and tantalizing food shows, as well as a myriad of variety shows and other world series.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(57, '5779979d-394d-4961-89f2-a8d29f4d0fd0', 'Glow TV', '167', 'GLT', 'http://cdn.dstv.com/www.dstv.com/dstvchannels/NowLogos/Glow_Small.png', NULL, 'Glow is a 24 hour entertainment channel that features content with high production values, universal story-lines and compelling themes. Our content is eastern inspired and has been locally curated for the South African market. Genres include: food, soapies, comedy, movies, travel, variety (talk show, music, celebrity gossip) and reality.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(58, '1bf6867b-2a1f-4357-8c6b-c844a14be27f', 'ROK', '168', '19K', 'http://rndcdn.dstv.com/dstvcms/2016/10/31/ROK_new4-4logo_xlrg.png', NULL, 'ROK is an entertainment channel showcasing the latest and greatest Nollywood movies and series with one of the largest Nollywood content libraries in the world.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(59, '0d380be5-8f0e-495f-9113-f91317659e80', 'Fashion One', '178', 'FTV', NULL, 'http://www.fashionone.com/', 'Thinking fashion as it pertains to television, it is not limited to just runway and models. Viewers can find fashion, trends and style everywhere. From photography, street style and beauty tips, to designer retrospectives and the latest celebrity trends, Fashion One reveals fashion in all aspects of life. It is the One channel dedicated to fashion, entertainment and lifestyle.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(60, 'e712ce69-6367-4d8b-9d9c-1cf675722679', 'SABC 1', '191', 'SA1', 'http://cdn.dstv.com/www.dstv.com/dstvchannels/NowLogos/sabc_1_sml.png', 'http://www.sabc1.co.za/', 'SABC 1 is commercially oriented local channel aimed at a funky youth audience. If you feel like some fun, escapism or something a little more provocative - then this is the channel for you.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(61, '03520214-d35a-4970-b08f-ad4ac87ffb05', 'SABC 2', '192', 'SA2', 'http://cdn.dstv.com/www.dstv.com/dstvchannels/NowLogos/sabc_2_sml.png', 'http://www.sabc2.co.za/', 'Programming is chosen to uplift and enlighten the viewer, and provide entertainment for the family. The channel embraces the cultural diversity of the African continent - it is the spirit of African Renaissance. For a good dose of Afrikaans, Xhosa and Zulu programming this is the channel for you.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(62, 'ecc41656-2e12-45bc-a1b0-e778cba7ce75', 'SABC 3', '193', 'SA3', 'http://cdn.dstv.com/www.dstv.com/dstvchannels/NowLogos/sabc_3_sml.png', 'http://www.sabc3.co.za/', 'SABC 3 balances excellent entertainment programming with sport, news and actuality content.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(63, 'ee54a0fd-d248-4b17-b2a3-170c593f1619', 'e.tv HD', '194', 'HDE', 'http://cdn.dstv.com/www.dstv.com/dstvchannels/NowLogos/ETV_sml.png', 'http://www.etv.co.za', 'Watch world class entertainment, local style and Be Free with e.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(64, 'cda0e85c-571a-4303-9abc-783db0ee0f6a', 'Big Brother Naija', '198', 'HSI', 'http://rndcdn.dstv.com/dstvcms/2017/01/17/Big-Brother-Naija_channel_new4-4logo_001_xlrg.png', NULL, 'Big Brother Naija is a Nigerian television reality show which features 24-hour camera surveillance of contestants living in one house. They are voted off by viewers until there is only one remaining who gets to win the ultimate prize.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(65, 'de5ba9c7-ebc5-4ea2-8e81-d1be4fb402df', 'Soweto TV', '251', 'STV', 'http://cdn.dstv.com/www.dstv.com/dstvchannels/NowLogos/SowetoTV_small.png', 'http://www.sowetotv.co.za/', 'An interactive, engaging and informative ‘talk radio on television’ concept, where presenters and producers engage with Soweto viewers about issues relevant to Sowetans. It is about Soweto every day in every household.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(66, 'a9d10da0-3343-4d17-8a84-55046e1470f4', 'Bay TV', '260', 'TVB', 'http://rndcdn.dstv.com/dstvcms/2016/07/15/DStv_BayTV_new4-4logo_xlrg.png', 'http://www.bay-tv.co.za/', 'Bay TV’s programming incorporates a diverse local culture and religion and highlights community issues in local languages. Other genres include education, entertainment, healthcare and environmental affairs.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(67, '039f82d8-b1df-4c12-bea0-af289d4f1d00', '1 KZN', '261', '1KZ', 'http://cdn.dstv.com/www.dstv.com/dstvchannels/NowLogos/KZNTV_small.png', 'http://www.1kzntv.co.za/', '1KZN is a channel that promotes local culture and showcase content from KZN.The channel broadcasts various children’s programming, youth, women, education, news & current affairs, sports, music & culture and gospel content.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(68, '3d8a823e-b750-45cf-9e17-4523025a6886', 'Tshwane TV', '262', 'TSH', 'http://cdn.dstv.com/www.dstv.com/dstvchannels/NowLogos/TswaneTV_small.png', 'http://www.tshwane.tv/', 'Tshwane TV is an urban and contemporary community channel that provides entertaining, informative programming that appeals and is relevant to various South African sub-cultures.  This general entertainment channel covering the Tshwane region includes infotainment with a focus on youth, lifestyle and current affairs.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(69, 'e4b0a7d0-4b09-42fb-a873-a46dfca85521', 'Cape Town TV', '263', 'CTV', 'http://cdn.dstv.com/www.dstv.com/dstvchannels/NowLogos/CapeTownTV_small.png', NULL, 'Cape Town TV is a community television channel. CTV broadcasts a fascinating programme mix ranging from documentaries to community news, music, spirituality, education, amateur sport, children\'s shows, comedy, cooking, theatre and films', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(70, 'e4c1a199-83a2-49de-a863-908df576b2c7', 'GauTV', '265', 'GAU', 'http://cdn.dstv.com/www.dstv.com/dstvchannels/NowLogos/GauTV_small.png', NULL, 'Gau TV is a general entertainment channel that showcases the vibrancy of Gauteng and its people. From Joburg, to Sedibeng to Ekurhuleni and all the way to Tshwane and Mogale City, Gau TV is Gauteng. With a wide and varied programming schedule, you can expect to wake up to gospel each morning followed by light kiddies programmes and morning news to start off your day. Your afternoons are filled with enriching programmes that are targeted at the youth; from talk shows to great educational content and upbeat music shows. Late afternoons on Gau TV are dedicated to local dramas and soapies, which, if missed, can be caught again during the late morning repeat slot.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(71, '2306dd3d-1bc1-4f3a-8cdb-8e4c6d5b8b4b', 'Lesotho TV', '292', 'LTV', 'http://cdn.dstv.com/www.dstv.com/dstvchannels/NowLogos/tv1_sml.png', 'http://www.lnbs.org.ls/', 'Free-to-air Channel', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(72, '6c4ac6dd-5781-4913-b1c4-99e65e7e201c', 'RAI Italia', '430', 'RAI', 'http://cdn.dstv.com/www.dstv.com/dstvchannels/NowLogos/RaiItalia_small.png', 'http://www.international.rai.it/', 'RAI Italia is the first Italian multimedia network producing TV, radio and information on the World Wide Web, providing 24 hour programming to people of Italian origin around the world, promoting the image of Italy across the globe.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(73, '5cf53462-ba1d-4cd9-882e-1bcfb245935c', 'BVN', '431', 'BVN', 'http://cdn.dstv.com/www.dstv.com/dstvchannels/NowLogos/BVN_small.jpg', 'http://www.bvn.nl/', 'BVN is a public television channel targeting Dutch speaking viewers. It carries news, sports, series, entertainment, movies and documentaries 24 hours a day.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(74, '1ee1e48c-5929-4abe-aa97-b066d7599fa4', 'TV5 Monde Afrique', '437', 'TVK', 'http://cdn.dstv.com/www.dstv.com/dstvchannels/NowLogos/TV5-Monde_small.png', 'http://www.tv5.org/', 'A dynamic French television channel offering fresh on the spot news coverage from Entertainment, sport and hard news. The channel boasts of top notch investigative and specialist journalists who cover its various news spectrum.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(75, 'e0da9043-7410-405d-8694-4f800dc677ff', 'CCTV 4', '447', 'SHO', 'http://cdn.dstv.com/www.dstv.com/dstvchannels/NowLogos/CCtv42012_small.png', 'http://english.cntv.cn/01/index.shtml', 'CCTV-4 carries news, documentaries, and television series targeting Mandarin, Cantonese and English speaking viewers 24 hours a day.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(76, '49e42819-92b6-4c95-b3b7-3732550df95b', 'RTP Internacional', '525', 'RTP', 'http://cdn.dstv.com/www.dstv.com/dstvchannels/NowLogos/RTP_Internacional_small.png', 'http://www.rtp.pt', 'Canal generalista português, inclui futebol, notícias diárias e ficção.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49'),
(77, 'b9b44e86-b8fd-446b-bd04-49d5a0db8c75', 'M-Net Plus 1', '901', 'MN1', 'http://rndcdn.dstv.com/dstvcms/2016/06/01/DStvNowApp_M-NetPlus1_new1-1logo_xlrg.png', 'http://mnet.dstv.com/', 'MNET+1 (channel 901) is the MNET channel (101), delayed by an hour. Experience the latest blockbuster movies, gripping international series and highly acclaimed local shows in one magical destination, M-Net+1, Where Magic Lives.', 4, 'Y', '2017-03-07 13:35:49', '2017-03-07 13:35:49');
