INSERT INTO `programinfo` (`id`, `programid`, `title`, `description`, `programimage`, `programtype`, `imdb_id`, `imdb_rating`, `season_id`, `episode_id`, `date_created`, `date_updated`) VALUES
(1, '2d282d02-6166-4de6-a4df-12848b636083', 'Behind Bars: World\'s Toughest Prisons', '\'S1/E5 - Sofia Central Prison, Bulgaria\'. We reveal what it really means to be part of this very special world - from different angles. At each prison we visit, the audience will be immersed into daily prison life.', NULL, NULL, NULL, NULL, '1', '5', '2017-03-07 16:26:15', '2017-03-07 16:26:15'),
(2, 'd65acf94-7588-4c48-8566-d6c0be341a93', 'Homicide Hunter', '\'S1/E13 - Six Feet Under\'. Detective Kenda finds the body of Vicki Ross strangled and left in the back seat of her own car. Kenda must sort through the endless suspicious characters in Vicki\'s past to find the truth.', NULL, NULL, NULL, NULL, '1', '13', '2017-03-07 16:26:15', '2017-03-07 16:26:15'),
(3, '78b6ffa1-2b17-48f5-aed8-8f58550f20ca', 'Cold Case Files', '\'S1/E83 - The Bedroom Basher\'. A young pregnant wife was found raped and beaten in California, 1979. Concussed, she accused her then husband, who spent 17 years in jail before DNA revealed another man was to blame.', NULL, NULL, NULL, NULL, '1', '83', '2017-03-07 16:26:16', '2017-03-07 16:26:16'),
(4, '6ab90243-52fa-4b56-8c24-c127fe9c85e2', 'Unusual Suspects', '\'S5/E10 - Dangerous Fortune\'. A fortune teller and her daughter are brutally murdered in their home. Ritualistic elements leave investigators stunned until a paper trail leads them to their cold-blooded culprit.', NULL, NULL, NULL, NULL, '5', '10', '2017-03-07 16:26:16', '2017-03-07 16:26:16'),
(5, 'f9fa9a10-b210-429d-aab1-9be5564d5f24', 'On The Case With Paula Zahn', '\'S5/E17 - Snake In The Grass\'. A cloud of smoke leads two truckers to a shocking discovery the smoldering remains of a teenage girl.', NULL, NULL, NULL, NULL, '5', '17', '2017-03-07 16:26:16', '2017-03-07 16:26:16'),
(6, '2848846b-a829-4395-b4bd-69333cfbf972', 'Cold Case Files', '\'S1/E83 - The Bedroom Basher\'. A young pregnant wife was found raped and beaten in California, 1979. Concussed, she accused her then husband, who spent 17 years in jail before DNA revealed another man was to blame.', NULL, NULL, NULL, NULL, '1', '83', '2017-03-07 16:26:16', '2017-03-07 16:26:16'),
(7, 'd9f28d87-82e8-4e65-9b63-7b405426ad85', 'It Takes A Killer', '\'S1/E15 - The Vampire Teens\'. A group of high school outcasts are on the run after their leader commits a double homicide. Cops finally catch the thrill-seeking teens, only to find out they\'re a makeshift vampire cult.', NULL, NULL, NULL, NULL, '1', '15', '2017-03-07 16:26:17', '2017-03-07 16:26:17'),
(8, 'a730438b-55df-4aa5-967a-54e27f4fcea4', 'The First 48', '\'S18/E12 - M.I.A.\'. A welder has vanished under very suspicious circumstances and Tulsa homicide gets the case. Detective Frazier and the rest of the team suspect foul play as they dive deep into the mystery surrounding the man\'s life.', NULL, NULL, NULL, NULL, '18', '12', '2017-03-07 16:26:17', '2017-03-07 16:26:17'),
(9, 'c99accea-0998-45d1-a0d6-98b74070640d', 'Homicide Hunter', '\'S1/E13 - Six Feet Under\'. Detective Kenda finds the body of Vicki Ross strangled and left in the back seat of her own car. Kenda must sort through the endless suspicious characters in Vicki\'s past to find the truth.', NULL, NULL, NULL, NULL, '1', '13', '2017-03-07 16:26:17', '2017-03-07 16:26:17'),
