(128, 'ae997489-c9cd-413e-bc13-01dd7071330f', 'Perfect Storms', '\'S1/E3 - America\'s Deadliest Disaster\'. In 1900, the island city of Galveston, Texas, is on the verge of greatness. Nicknamed the New York of the South, it boasts the second most millionaires per capita of any city in the nation.', NULL, NULL, NULL, NULL, '1', '3', '2017-03-07 16:26:39', '2017-03-07 16:26:39'),
(129, '2dc1d39f-19d7-4997-960f-8bf92c8c37d1', 'Ancient X Files', '\'S2/E4 - Decoding The Incas\'. The ancient Incas ruled over most of South America 500 years ago. Their empire spanned the continent with roads, temples and mysterious cities built to incredible precision.', NULL, NULL, NULL, NULL, '2', '4', '2017-03-07 16:26:39', '2017-03-07 16:26:39'),
(130, 'b7d3bacd-d0e2-42af-a842-ae0173df14e9', 'Drugs, Inc.', '\'S5/E5 - Dope-Landia\'. Portland is the mecca of homeless American youth, rife with dealers handing out free sample bags of narcotics to turn them into new customers.', NULL, NULL, NULL, NULL, '5', '5', '2017-03-07 16:26:40', '2017-03-07 16:26:40'),
(131, '9b9cb578-aaec-460c-8415-012119fb8ce1', 'Wicked Tuna', '\'S3/E4 - Operation T.U.N.A.\'. The fishermen of Gloucester are desperate for bluefin tuna and, with the fishing migration in an unpredictable state, some resort to espionage.', NULL, NULL, NULL, NULL, '3', '4', '2017-03-07 16:26:40', '2017-03-07 16:26:40'),
(132, '8e464a46-9f07-4d2a-a536-80aaa3f04757', 'Mystery Files', 'Princes in the Tower - Join medieval historians as they separate fact from Tudor propaganda in an attempt to solve of 500-year-old murder mystery.', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTQ0MTkwMzI4MF5BMl5BanBnXkFtZTgwMDc1MzY2MjE@._V1_SX300.jpg', 'episode', 'tt1595415', 6.8, '1', '4', '2017-03-07 16:26:41', '2017-03-07 16:36:59'),
