(155, '7ac2442a-b2c9-4447-95c9-0a1ea46ef767', 'Car S.O.S', '\'S5/E1 - Fiat Dino\'. Car lover Chris has had his beloved, Ferrari engined, 1971 Fiat Dino coupe for nearly 25 years. The former engine mechanic had to put the restoration on hold when he was diagnosed with a rare type of cancer.', NULL, NULL, NULL, NULL, '5', '1', '2017-03-07 16:26:45', '2017-03-07 16:26:45'),
(156, 'fff8315d-3732-4901-a46c-f96368871f8f', 'Megafactories', '\'S1/E57 - Super Cars: Lamborghini Aventador\'. In 2011, almost a decade since the release of its last flagship model, the Murcielago, Lamborghini launched its latest creation - the Aventador.', NULL, NULL, NULL, NULL, '1', '57', '2017-03-07 16:26:45', '2017-03-07 16:26:45'),
(157, '24ed0770-8dd8-4d3f-92ec-76421f5c1cdd', 'Drugs, Inc.', '\'S5/E6 - Snitch Cities\'. Police turn to confidential informants to hunt down the mobile dealers in Minneapolis and Saint Paul who deal some of the purest heroin around.', NULL, NULL, NULL, NULL, '5', '6', '2017-03-07 16:26:46', '2017-03-07 16:26:46'),
(158, 'af71d4e8-197f-4eb7-b17f-ab07f355e310', 'Lawless Island', '\'S2/E7 - Shell-Shocked\'. The community of Port Protection is strengthened by the individual in a constant quest to persevere against nature\'s changing obstacles. Gary builds a new and safer section of boardwalk leading to his house.', NULL, NULL, NULL, NULL, '2', '7', '2017-03-07 16:26:46', '2017-03-07 16:26:46'),
(159, '3c063c2c-2968-45e2-bbdd-374e78e6c796', 'Highway Thru Hell', '\'S4/E8 - My Purpose is to Protect\'. When Jamie and Jason Davis Heavy Recovery crews team up for a massive wreck, a close call forces Brandon to reconsider his future in the business.', NULL, NULL, NULL, NULL, '4', '8', '2017-03-07 16:26:47', '2017-03-07 16:26:47'),
(160, '72439fda-2c6d-447c-b1ac-b76ac685cc26', 'America\'s Deadliest', 'Utilizing the best of the best wildlife footage that\'s chock-full of predation, this one-hour special celebrates The States\' baddest beasts including bears, wolves, cougars, gators and bald eagles.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:26:47', '2017-03-07 16:26:47'),
(161, '51ee1d5f-9d8b-4545-aaed-2543fffac564', 'Elephant Queen', 'After the tragic death of her mother, the old elephant matriarch, Mensah must now take her young calf and the herd to safety. She is their final hope and must lead them into their ancient feeding grounds.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:26:47', '2017-03-07 16:26:47'),
(162, '808d2910-72c6-4d1c-ad5d-9839c3b9de96', 'The Wolf Mountains', 'The story of one of the last wildernesses in Europe, where each creature plays its role in the eternal cycle of life and death. This land was known in the past as the Wolf Mountains, a region that straddles Slovakia, Poland and Ukraine.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:26:48', '2017-03-07 16:26:48'),
(163, '1fa642c3-5eea-471e-a33c-07476ec15f91', 'Soul Of The Cat', 'This film will look at the behaviors between domestic cats and their wild cousins and ancestors, specifically to draw those parallels and to explain to \'owners\' what they are seeing when they watch their cat.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:26:48', '2017-03-07 16:26:48'),
(164, 'fd0b688d-265b-4b25-9169-aac3ee942f86', 'Queen Of The Chase', 'Many cheetahs prowl the south-eastern open plains of the Serengeti in Tanzania. Safely secluded in the tall grass lies a cheetah mother with her five cubs. Hunting is essential for the survival of herself and her young, but always risky.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:26:48', '2017-03-07 16:26:48'),
(165, '1d972373-216e-48ce-94ca-56713d05b6f6', 'Ultimate Animal Countdown', '\'S1/E10 - Attack\'. A chart combining the likelihood of attack with the power of their weapons and the number of humans harmed, determines the most dangerous animals.', NULL, NULL, NULL, NULL, '1', '10', '2017-03-07 16:26:48', '2017-03-07 16:26:48'),
(166, '86d7297d-69e5-4793-afab-6596fd8d4dba', 'Wild Menu', '\'S1/E3 - The Fruit Of Temptation\'. The shapes, sizes, colours, aromas and flavours of fruit vary, but they\'re all meant to attract animals and thereby spread the seeds inside.', NULL, NULL, NULL, NULL, '1', '3', '2017-03-07 16:26:48', '2017-03-07 16:26:48'),
(167, '60aa1c9e-d784-4f1a-8bc8-69240d4c88d2', 'Wild Menu', '\'S1/E9 - Children\'s Menu\'. Some animals eat the same thing from birth to death. Others enjoy a special diet which gets them through the first stages of life.', NULL, NULL, NULL, NULL, '1', '9', '2017-03-07 16:26:48', '2017-03-07 16:26:48'),
(168, '9223e57b-4916-4102-b45d-056d557eecaa', 'Wild Menu', '\'S1/E1 - Restaurant Earth\'. Many living things get chomped, chewed and swallowed by millions of other hungry creatures, all of them diners at the restaurant called Earth.', NULL, NULL, NULL, NULL, '1', '1', '2017-03-07 16:26:48', '2017-03-07 16:26:48');
