(169, '4098a7de-c1b7-4f52-92aa-32d65294b57a', 'Wild Menu', '\'S1/E7 - Assorted Salads\'. Earth\'s jungles and forests serve up a 24-hour salad bar to animals that can tell the difference between a banquet of greens and toxic plants.', NULL, NULL, NULL, NULL, '1', '7', '2017-03-07 16:26:49', '2017-03-07 16:26:49'),
(170, 'd542f4ae-bf82-4db8-bc72-49f8e6b10b5d', 'Turf War: Lions And Hippos', 'In Africa\'s Luangwa valley, the dry season sees lions hunting the beaches, but hungry hippos are unwilling to share their domain with predators.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:26:49', '2017-03-07 16:26:49'),
(171, 'c91995bc-2040-4501-bb22-945867e10ecc', 'Africa\'s Deadliest', '\'S1/E3 - Lethal Weapons\'. Tusks, claws and beaks can pierce, stun and maim - sometimes enabling prey to turn the tables on predators.', NULL, NULL, NULL, NULL, '1', '3', '2017-03-07 16:26:49', '2017-03-07 16:26:49'),
(172, 'a64fccd6-5bd9-4bd2-ba4d-1a2f1f17af55', 'Monster Catfish', 'European catfish, the continent\'s largest freshwater fish measuring up to 2,67 meters are quickly evolving as they colonise new rivers. They are currently displaying completely new behaviour, colours or sizes.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:26:49', '2017-03-07 16:26:49'),
(173, '258c527f-e887-49e4-b92c-0ad7e4259741', 'Wild Menu', '\'S1/E7 - Assorted Salads\'. Earth\'s jungles and forests serve up a 24-hour salad bar to animals that can tell the difference between a banquet of greens and toxic plants.', NULL, NULL, NULL, NULL, '1', '7', '2017-03-07 16:26:49', '2017-03-07 16:26:49'),
(174, '024ef7d5-e9b1-40f9-a1b6-d7fb33203545', 'Amazon\'s Electric Fish', 'The Amazon has the highest diversity of life on the planet, but what lies below it is truly shocking. In its deep muddy rivers, a freak show of fish life has exploded, with some of the strangest shapes and weirdest adaptations on Earth.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:26:49', '2017-03-07 16:26:49'),
(175, 'e528b077-5c7e-4267-8811-ddc86c70c5e8', 'America\'s Deadliest', 'Utilizing the best of the best wildlife footage that\'s chock-full of predation, this one-hour special celebrates The States\' baddest beasts including bears, wolves, cougars, gators and bald eagles.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:26:50', '2017-03-07 16:26:50'),
(176, 'aab550ce-1cc6-454d-a927-77ca76207219', 'The Kangaroo King', 'The parched central deserts of the red heartland of Australia are home to the toughest kangaroo on the planet: the mighty Red. This is a story of survival against the odds and what it takes to endure drought, heatwave and bushfire.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:26:50', '2017-03-07 16:26:50'),
(177, '08a6b1df-96d5-4c1a-b700-370944103036', 'Turf War: Lions And Hippos', 'In Africa\'s Luangwa valley, the dry season sees lions hunting the beaches, but hungry hippos are unwilling to share their domain with predators.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:26:50', '2017-03-07 16:26:50'),
