(179, '7c10b6d8-255a-42d4-a821-fe7636f05341', 'The World\'s Most Wanted Leopard', 'Adrian Steirn travels from Africa to Azerbaijan in search of the highly endangered Caucasian leopard. This near-mythical creature is on the brink of extinction in a land of remarkable biodiversity and stark contrasts.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:26:50', '2017-03-07 16:26:50'),
(180, '7c9f2555-947f-477f-9649-c5a8ac917908', 'Lion Gangland', 'In a remote corner of the Serengeti, a unique lion pride called \'Vumbi\' battles high heat, shortages of food and water and a dangerous rival coalition in its struggle to survive.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:26:50', '2017-03-07 16:26:50'),
(181, '51cb01e3-0135-4ae7-ad5f-0f944c71077e', 'Turf War: Lions And Hippos', 'In Africa\'s Luangwa valley, the dry season sees lions hunting the beaches, but hungry hippos are unwilling to share their domain with predators.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:26:50', '2017-03-07 16:26:50'),
(182, 'e0a69e2d-c2e2-4ab6-b29f-b0cfa7ba6346', 'Sharkatraz', 'The worst of the worst, the toughest of the tough were all sent to The Rock. And they all wanted to escape, but their biggest obstacle wasn\'t the walls, the bars or the guards - it was the sharks.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:26:51', '2017-03-07 16:26:51'),
(183, '0abfd12c-ef11-4e07-a8c7-919c7bab49c3', 'The Lion Whisperer', 'The remarkable Kevin Richardson has spent many years living surrounded by domesticated lions.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:26:51', '2017-03-07 16:26:51'),
(184, '068819cc-9bf8-46dd-9631-20da71b3d559', 'World\'s Deadliest Animals', '\'S2/E2 - Costa Rica\'. From the parched deserts of Southwestern United States to lush forests of the Costa Rican mountains, we cover some of the most diverse ecosystems on the planet.', NULL, NULL, NULL, NULL, '2', '2', '2017-03-07 16:26:51', '2017-03-07 16:26:51'),
(185, '32c1b235-9922-4229-862c-1cb83cde55ce', 'Lion Gangland', 'In a remote corner of the Serengeti, a unique lion pride called \'Vumbi\' battles high heat, shortages of food and water and a dangerous rival coalition in its struggle to survive.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:26:51', '2017-03-07 16:26:51'),
(186, 'e1226471-be3c-4c03-8791-e258c08c146c', 'Surviving The Serengeti', 'Surviving the Serengeti is a tale of courage and instinct of hope and desperation. Set in East Africa, the story is told against the backdrop of one of the most beautiful places on Earth. It is a journey of growth and survival.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:26:51', '2017-03-07 16:26:51'),
