(192, 'ef77870a-07cf-4cbf-897f-224db27e8c87', 'Bondi Vet', '\'S6/E21 - 6/21\'. Chris makes a discovery on a miniature goat that horrifies its owner. Later, Chris takes a daring dive to save an endangered shark species while Lisa tries to save a dog.', NULL, NULL, NULL, NULL, '6', '21', '2017-03-07 16:26:53', '2017-03-07 16:26:53'),
(193, '2bffc6ad-4fcc-4115-933c-18c35eaed5c5', 'Dr. Dee: Alaska Vet', '\'S1/E5 - Don\'t Mess With Mama\'. Dr Dee checks the health of a black bear who has just woken from hibernation. A routine cattle castration turns dangerous. A special-needs dog seeks a home.', NULL, NULL, NULL, NULL, '1', '5', '2017-03-07 16:26:53', '2017-03-07 16:26:53'),
(194, 'bd1a912e-b061-44a2-832e-0d072180d711', 'Tanked', '\'S3/E9 - Smiling Is The Best Medicine\'. Wayde and Brett transform a disused photo booth into an aquarium for the Las Vegas First Friday street fair, but will it be smiles all round?', NULL, NULL, NULL, NULL, '3', '9', '2017-03-07 16:26:54', '2017-03-07 16:26:54'),
