(279, '787ef4de-238f-4afd-b57e-ed3680d33413', 'Pawn Stars', '\'S16/E21 - One Man\'s Junk\'. Step up to the plate with the Pawn Stars when a baseball believed to be signed by the 1959 World Series Champions, the Dodgers, gets thrown into the shop.', NULL, NULL, NULL, NULL, '16', '21', '2017-03-07 16:27:09', '2017-03-07 16:27:09'),
(280, '1b073bae-1278-497a-bc08-866282181803', 'Ancient Top 10', '\'S1/E8 - Greatest Ancient Metropolises\'. From the grandeur of Rome to the incredible Chinese city Xi\'an, which ancient metropolis will take the crown as most renowned?', NULL, NULL, NULL, NULL, '1', '8', '2017-03-07 16:27:09', '2017-03-07 16:27:09'),
(281, 'ea075e0e-4f33-4025-bd53-902e5d11701e', 'Pawn Stars', '\'S18/E20 - Smokin\' Pawn\'. A lithograph from \'Alien 3\' creeps in. And later, when a Smokey the Bear puppet blazes in, will it ignite Chum\'s fire or will he prevent the deal?', NULL, NULL, NULL, NULL, '18', '20', '2017-03-07 16:27:09', '2017-03-07 16:27:09'),
(282, '3d7110d4-f944-496b-8364-874d5323cbbd', 'Pawn Stars', '\'S18/E16 - Death And Taxidermy\'. A 1547 edition of \'The Dance of Death\' haunts the shop. Next, things get whimsical when two sculptures from Dr Seuss\' unorthodox taxidermy collection are brought in.', NULL, NULL, NULL, NULL, '18', '16', '2017-03-07 16:27:10', '2017-03-07 16:27:10'),
