(287, '8e4f0a66-b48b-4782-bffa-d758f0e32f17', 'Auto Mundial', '\'S2/E10 - 2/10\'. We take a look at Subaru\'s seven seater Viziv and BMW\'s two and two halves seater - the 650i. Then, bigger and cheaper than Touareg, that\'s Atlas on a mission, and the timeless Bentley GT.', NULL, NULL, NULL, NULL, '2', '10', '2017-03-07 16:27:11', '2017-03-07 16:27:11'),
(288, 'd3f7904a-0fc5-4633-a6f8-d2a403901382', 'Drive It!', '\'S2/E10\'. We take a look at the M7-60 Li XDrive, the annual upgrade for the Mazda 6, Fiat Chrysler\'s special model, the Cherokee Trailhawk and we compare five luxury sedans.', NULL, NULL, NULL, NULL, '2', '10', '2017-03-07 16:27:12', '2017-03-07 16:27:12'),
(289, 'b64f294b-4dca-4845-b699-dfc459d7c9b0', 'Put Your Car On TV', '\'S1/E7 - 1/7\'. Mylene and Saif chat to Alex Renner from ARM Motors Dubai and we feature the Chrysler SRT8, Chevrolet Camaro SS and Hummer H2.', NULL, NULL, NULL, NULL, '1', '7', '2017-03-07 16:27:12', '2017-03-07 16:27:12'),
(290, '8118ce47-3f0b-4cba-8479-054b64767ab1', 'Stunt Heroes', '\'S1/E10 - 1/10\'. Martial arts specialist, Ramazan, developed fight choreography. As four stuntmen disguised as agents \'attack\' him, will he be able to free himself? Find out in this episode of Stunt Heroes.', NULL, NULL, NULL, NULL, '1', '10', '2017-03-07 16:27:12', '2017-03-07 16:27:12'),
(291, 'b6c1adfd-a24f-49ad-992d-74fa68b0f6d8', 'Road Madness', '\'S1/E4 - 1/4\'. Over-takers taking risks you won\'t believe, watch as these maniacs execute passing maneuvers that will have you wondering if they should be on our roads at all.', NULL, NULL, NULL, NULL, '1', '4', '2017-03-07 16:27:12', '2017-03-07 16:27:12'),
(292, 'd1cbd4ef-4a82-4939-b415-752966d91e50', 'American Trucker', '\'S2/E3 - 2/3\'. Considered a dying breed by some, independent owner-operators are still the backbone of the local and regional trucking industry.', NULL, NULL, NULL, NULL, '2', '3', '2017-03-07 16:27:13', '2017-03-07 16:27:13'),
(293, '13fcdf71-8d02-415e-a005-f397a62b55aa', 'Champions: Jim Clark', '\'S1/E3 - 1/3\'. We look at the career of Jim Clark. From 72 starts, Clark won 27 Grand Prix - a success ratio only bettered by Fangio and Ascari - and he was World Champion, driving Lotus cars in 1963 and 1965.', NULL, NULL, NULL, NULL, '1', '3', '2017-03-07 16:27:13', '2017-03-07 16:27:13'),
(294, '6945351b-57d9-47db-b9a8-a9c392b12910', 'Champions: Didier Auriol', '\'S1/E1 - 1/1\'. Having been introduced to rallying in the late 70\'s, Frenchman Didier Auriol showed early promise and soon clinched his first major victory in 1985 with, as he put it, \'good times in a bad car\'.', NULL, NULL, NULL, NULL, '1', '1', '2017-03-07 16:27:13', '2017-03-07 16:27:13'),
(295, '7f0be6df-4def-495a-a232-a4cbceb62d1f', 'IGNITION GT', '\'S2/E10 - 2/10\'. Brenwin finds out whether the Mitsubishi Triton can stake its claim in the SA bakkie market. Maserati\'s new Levante is set to create a sizeable hole in many a well-heeled pocket. Four premium hatchbacks go head to head.', NULL, NULL, NULL, NULL, '2', '10', '2017-03-07 16:27:13', '2017-03-07 16:27:13'),
(296, '3af4ea27-f1d8-49e1-8e1a-a090c447fa87', 'Made In Germany', '\'S1/E5 - 1/5\'. The BMW Group is the industry leader in environmentally friendly production and sustainability. We examines the company\'s manufacturing techniques and facilities to find out why they have less impact on the planet.', NULL, NULL, NULL, NULL, '1', '5', '2017-03-07 16:27:13', '2017-03-07 16:27:13'),
(297, 'a65a2fdd-687e-4b6b-84b5-fb39e109b752', 'Four-Wheel Drive', '\'S6/E7\'. The Range Rover Classic is one of the most beautiful cars ever created, and for Andrew\'s birthday he took a Suffix-A Range Rover (from the first production run) for a trip around beautiful Wales.', NULL, NULL, NULL, NULL, '6', '7', '2017-03-07 16:27:13', '2017-03-07 16:27:13'),
(298, '5635b543-853e-4805-a8bc-c099838769d0', 'Misfit Garage', '\'S3/E6\'. In the wake of Scot and Austin quitting the garage, the Fired Up guys call on friends and family to help prep and repair the \'67 Camaro. Meanwhile, Thomas and Tom have their eye on a \'73 Firebird.', NULL, NULL, NULL, NULL, '3', '6', '2017-03-07 16:27:13', '2017-03-07 16:27:13'),
(299, '82bbeff0-ea88-4df0-a25a-d03473c60d2f', 'Inland Championship', '\'S1/E6\'. We bring you the race highlights from the Bridgestone BMW Car Club racing series, Big Boss Auto Super Saloons, Yokohoma MPC/SRA and Inex Legends Championship for the final round of Inland Championship last year.', NULL, NULL, NULL, NULL, '1', '6', '2017-03-07 16:27:14', '2017-03-07 16:27:14'),
(300, '007324b6-0773-48de-bbd4-e1015aeaae38', '4x4 Offroad', '\'S2/E6\'. Bentley and Jaguar have joined the SUV party with the Bentayga and F-Pace. We look back when their luxury SUV concepts were unveiled. Are luxury SUVs unnecessary or uncompetitive? Or are they better than the others?', NULL, NULL, NULL, NULL, '2', '6', '2017-03-07 16:27:14', '2017-03-07 16:27:14'),
(301, '7d2b589e-0493-407f-bd4b-0362297f6945', 'Buyer\'s Guide', '\'S2/E10 - 2/10\'. We look for a hatchback between R300 - R350 000 - the options are endless! A mommy is looking for a good second hand transporter, and in our best buys, we\'re helping students with their first car choices.', NULL, NULL, NULL, NULL, '2', '10', '2017-03-07 16:27:14', '2017-03-07 16:27:14'),
(302, '93f29cae-610b-4c76-b64f-57d87d9043d1', 'Petrolheads', '\'S2/E9 - 2/9\'. We touch down in the Mother City for the inaugural Cape Town Motor Show. Bots shows off their next contender for Burnout Kings and we go shot gun in a Harper Type 5 Turbo.', NULL, NULL, NULL, NULL, '2', '9', '2017-03-07 16:27:14', '2017-03-07 16:27:14'),
(303, '14626ec2-5281-49c1-8d8e-55513e2ab2c6', 'Dumbest Stuff On Wheels', '\'S1/E5 - 1/5\'. A tourist drives off an overpass, a tattooed biker takes a tumble and cars collide in the world\'s worst intersection.', NULL, NULL, NULL, NULL, '1', '5', '2017-03-07 16:27:14', '2017-03-07 16:27:14'),
(304, 'a5e0ae98-4b55-4b0b-83c9-31b5d75059c1', 'Grand Prix Greats', '\'S1/E5 - 1/5\'. Scotland\'s Jim Clark won the World Championship twice, he was a sublimely smooth, superbly slick driver who was said never to abuse the cars he drove to 25 Grand Prix victories.', NULL, NULL, NULL, NULL, '1', '5', '2017-03-07 16:27:14', '2017-03-07 16:27:14'),
