(309, 'c1b3a0cd-c43b-4191-9544-49b1103819bf', 'Search And Restore', '\'S2/E19\'. The Terhar family from Tacoma, Washington comes to the Tech Centre, along with 4 dozen volunteers who returned to see the keys handed over to our worthy viewer.', NULL, NULL, NULL, NULL, '2', '19', '2017-03-07 16:27:15', '2017-03-07 16:27:15'),
(310, 'b6455790-596b-4e8e-8fe8-e71389f8b04f', 'Supercars', '\'S3/E19\'. The California T heralded a new era for Ferrari. The facelifted version is the first prancing horse to sport a turbo engine since the legendary F40, which was built in 1992. Even Ferrari can\'t avoid some downsizing.', NULL, NULL, NULL, NULL, '3', '19', '2017-03-07 16:27:15', '2017-03-07 16:27:15'),
