(457, 'cf6a26c7-96c6-46e8-8ee8-8c5aaa91c034', 'I Wouldn\'t Go In There', 'Hong Kong: Haunted School - Frightening stories of suicide and ghosts emanate from the abandoned Tat Tak school in Hong Kong\'s sleepy Ping Shan village. Video blogger RJ investigates the rumored hauntings to track ...', 'N/A', 'episode', 'tt3659810', 0, '1', '1', '2017-03-07 16:27:45', '2017-03-07 16:37:16'),
(458, '57c1221c-6dd8-4dff-b915-7db7c3d31171', 'Perfect Storms', '\'S1/E4 - Dark Age Volcano\'. Dark Age Volcano examines a massive sixth-century volcanic eruption in El Salvador, and it\'s devastating impact on the Maya people living within its range and beyond.', NULL, NULL, NULL, NULL, '1', '4', '2017-03-07 16:27:46', '2017-03-07 16:27:46'),
(459, 'f106839a-3f2b-43c3-abf7-318329b8b918', 'Ancient X Files', '\'S2/E5 - Crown Of Thorns\'. According to the Gospels, the Crown of Thorns was worn by Jesus Christ during his crucifixion and is today one of the Catholic religion\'s most sacred relics.', NULL, NULL, NULL, NULL, '2', '5', '2017-03-07 16:27:46', '2017-03-07 16:27:46'),
(460, '219551ee-2989-4cf1-a31e-9efaa7ce1072', 'Drugs, Inc.', '\'S5/E6 - Snitch Cities\'. Police turn to confidential informants to hunt down the mobile dealers in Minneapolis and Saint Paul who deal some of the purest heroin around.', NULL, NULL, NULL, NULL, '5', '6', '2017-03-07 16:27:46', '2017-03-07 16:27:46'),
(461, '1b5ecaef-f12a-45d4-b31c-45bd74082b73', 'Wicked Tuna', '\'S3/E5 - Bite Fight\'. On the fifth week, the waters turn turbulent as the boats go head-to-head to outmuscle and outsmart their opponents.', NULL, NULL, NULL, NULL, '3', '5', '2017-03-07 16:27:47', '2017-03-07 16:27:47'),
(462, '3d14241c-aa5c-4200-a4b0-a52d143a5459', 'Mystery Files', '\'S1/E7 - Jack The Ripper\'. Notorious Victorian killer Jack the Ripper terrorised London in 1888, but was never caught. New evidence suggests he may not have worked alone.', NULL, NULL, NULL, NULL, '1', '7', '2017-03-07 16:27:47', '2017-03-07 16:27:47'),
(463, 'c1678a42-82a7-47cf-8ff5-8db302a7f303', 'Mystery Files', 'Leonardo Da Vinci - One of history\'s greatest artists also invented the tank, the helicopter, and the diving suit...or did he?', 'http://ia.media-imdb.com/images/M/MV5BOTI4OTAxMzI3N15BMl5BanBnXkFtZTgwMTQyNTY2MjE@._V1_SX300.jpg', 'episode', 'tt1661619', 6.7, '1', '8', '2017-03-07 16:27:47', '2017-03-07 16:37:16'),
(464, '62b55483-b1fd-4311-865b-e2708f0375e6', 'Mystery Files', 'Abraham Lincoln - Over time, Abraham Lincoln\'s status has risen to almost mythic proportions, but what\'s the real story behind the legend?', 'http://ia.media-imdb.com/images/M/MV5BMjA0MzE0MTI4NF5BMl5BanBnXkFtZTgwODgwNDU2MjE@._V1_SX300.jpg', 'episode', 'tt1586137', 7, '1', '9', '2017-03-07 16:27:48', '2017-03-07 16:37:16'),
(465, '56893ac3-ed3f-4998-b520-2cba7478d76a', 'How To Win At Everything', '\'S1/E4 - 1/4\'. We discover the secret to how experts hold their breath for incredible amounts of time and find out what\'s going on inside their bodies.', NULL, NULL, NULL, NULL, '1', '4', '2017-03-07 16:27:48', '2017-03-07 16:27:48'),
(466, '90fa1f38-a3aa-4d0f-b168-7486d3fbfb96', 'How To Win At Everything', '\'S1/E2 - 1/2\'. We discover how to win at football freestyling, plus get some science tips on becoming a keepy uppy king from a pro. We explore a way that might increase the chance of potting from the get go.', NULL, NULL, NULL, NULL, '1', '2', '2017-03-07 16:27:48', '2017-03-07 16:27:48'),
(467, '6babe7dc-4594-4bfc-8d50-4e9ae35455ad', 'Brain Games', '\'S4/E14 - Perspective\'. What do you see when you look at the world? Does reality really exist the way you experience it?', NULL, NULL, NULL, NULL, '4', '14', '2017-03-07 16:27:48', '2017-03-07 16:27:48'),
