(469, 'b3d2ec82-867e-4f18-9a28-45d166284752', 'The Yard', '\'S1/E5 - Alaskan Nor\'easter\'. The job of building and maintaining the nation\'s fleet of fishing boats, work vessels and passenger ships is fraught with stress.', NULL, NULL, NULL, NULL, '1', '5', '2017-03-07 16:27:48', '2017-03-07 16:27:48'),
