(472, '2482d72b-350f-436b-b608-7bb1dcd88956', 'Megafactories', '\'S1/E47 - Michelin\'. One of the largest tire companies in the world - Michelin - designs and manufactures everything from car and motorcycle tires, to the tires on Jumbo Jets and even the Space Shuttle.', NULL, NULL, NULL, NULL, '1', '47', '2017-03-07 16:27:49', '2017-03-07 16:27:49'),
