(487, '82e60f3e-ab1d-4bd4-ac8c-cccbd59354d0', 'Drugs, Inc.', '\'S5/E7 - Dallas Dope Cowboys\'. Buyers are desperate to get hold of the Cartel\'s high quality product. They travel to Dallas giving local dealers the chance to make big money.', NULL, NULL, NULL, NULL, '5', '7', '2017-03-07 16:27:51', '2017-03-07 16:27:51'),
(488, '8d3a8de5-1743-4d86-8877-f5d433928c83', 'Car S.O.S', '\'S5/E1 - Fiat Dino\'. Car lover Chris has had his beloved, Ferrari engined, 1971 Fiat Dino coupe for nearly 25 years. The former engine mechanic had to put the restoration on hold when he was diagnosed with a rare type of cancer.', NULL, NULL, NULL, NULL, '5', '1', '2017-03-07 16:27:51', '2017-03-07 16:27:51'),
(489, '0c628a85-ac01-4020-92a5-7fba63af3dc8', 'Megafactories', '\'S1/E57 - Super Cars: Lamborghini Aventador\'. In 2011, almost a decade since the release of its last flagship model, the Murcielago, Lamborghini launched its latest creation - the Aventador.', NULL, NULL, NULL, NULL, '1', '57', '2017-03-07 16:27:52', '2017-03-07 16:27:52'),
(490, '2e37039f-bc22-4565-aec0-b6cfbc6d81a7', 'Lion Gangland', 'In a remote corner of the Serengeti, a unique lion pride called \'Vumbi\' battles high heat, shortages of food and water and a dangerous rival coalition in its struggle to survive.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:27:52', '2017-03-07 16:27:52'),
(491, '0bcd27f2-5b4c-48ab-8867-dfbad5dca741', 'Turf War: Lions And Hippos', 'In Africa\'s Luangwa valley, the dry season sees lions hunting the beaches, but hungry hippos are unwilling to share their domain with predators.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:27:52', '2017-03-07 16:27:52'),
(492, 'fc46a553-5921-4f43-970d-e7c824a67410', 'Sharkatraz', 'The worst of the worst, the toughest of the tough were all sent to The Rock. And they all wanted to escape, but their biggest obstacle wasn\'t the walls, the bars or the guards - it was the sharks.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:27:52', '2017-03-07 16:27:52'),
(493, 'f8249240-12ed-4e03-8827-335b96cf7bf0', 'America\'s Deadliest', 'Utilizing the best of the best wildlife footage that\'s chock-full of predation, this one-hour special celebrates The States\' baddest beasts including bears, wolves, cougars, gators and bald eagles.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:27:53', '2017-03-07 16:27:53'),
(494, '10e75453-a9c4-4009-8515-7b6bab751374', 'The Kangaroo King', 'The parched central deserts of the red heartland of Australia are home to the toughest kangaroo on the planet: the mighty Red. This is a story of survival against the odds and what it takes to endure drought, heatwave and bushfire.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:27:53', '2017-03-07 16:27:53'),
(495, '5c70f9db-db23-4bcc-82ed-c4d37d0b5411', 'Ultimate Animal Countdown', '\'S1/E6 - Daredevils\'. From salamanders to barnacle geese, a look at animals whose habits see them taking some startling risks.', NULL, NULL, NULL, NULL, '1', '6', '2017-03-07 16:27:54', '2017-03-07 16:27:54'),
(496, '442248c6-93d7-4285-a764-410320748baa', 'Wild Menu', '\'S1/E5 - Pasta\'. The great grasslands of the world are fodder for animals whose digestive systems can handle a plentiful but hard-to-digest menu item.', NULL, NULL, NULL, NULL, '1', '5', '2017-03-07 16:27:54', '2017-03-07 16:27:54'),
(497, '5b7e1c82-8345-474d-9710-bf15d467abcb', 'Wild Menu', '\'S1/E3 - The Fruit Of Temptation\'. The shapes, sizes, colours, aromas and flavours of fruit vary, but they\'re all meant to attract animals and thereby spread the seeds inside.', NULL, NULL, NULL, NULL, '1', '3', '2017-03-07 16:27:54', '2017-03-07 16:27:54'),
(498, '7f4ea370-9e5d-473f-aa4d-527bda46b52c', 'Wild Menu', '\'S1/E9 - Children\'s Menu\'. Some animals eat the same thing from birth to death. Others enjoy a special diet which gets them through the first stages of life.', NULL, NULL, NULL, NULL, '1', '9', '2017-03-07 16:27:54', '2017-03-07 16:27:54'),
(499, '2de05c0a-b5d4-4544-98ae-4317057aa52a', 'The Lakeshore Killers', 'Deep within Africa\'s heart lies the Zambezi valley. At the centre of this wilderness lies a great lake, an Eden like nowhere else on Earth. Here we meet three male lions: Takunda, Gombwe and Zindoga.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:27:54', '2017-03-07 16:27:54'),
(500, 'ccd5b11e-829d-4c28-9603-41637d7fa142', 'Africa\'s Deadliest', '\'S1/E2 - Predator Swarm\'. In Africa strength in numbers can tip the scales of survival. Teamwork ups the hunters\' odds, but sometimes sheer numbers can decide who lives or dies. With an army on your side, size doesn\'t count.', NULL, NULL, NULL, NULL, '1', '2', '2017-03-07 16:27:54', '2017-03-07 16:27:54'),
(501, '1dcd59de-cb20-4b7b-a203-27896593be4a', 'The Living Edens', '\'S1/E20 - Glacier Bay: Alaska\'s Wild Coast\'. Nestled in the heart of south-east Alaska, Glacier Bay is a wild paradise of ocean and ice. Follow the lives of brown bears, bald eagles, humpback whales and other species.', NULL, NULL, NULL, NULL, '1', '20', '2017-03-07 16:27:54', '2017-03-07 16:27:54'),
(502, 'c0e13e67-ecc8-4a0e-93bf-7bb58a5e3388', 'Wild Menu', '\'S1/E9 - Children\'s Menu\'. Some animals eat the same thing from birth to death. Others enjoy a special diet which gets them through the first stages of life.', NULL, NULL, NULL, NULL, '1', '9', '2017-03-07 16:27:55', '2017-03-07 16:27:55'),
(503, 'c922f0a0-b58d-4573-b7bf-4d69bd980706', 'Wild Alaska', 'The rugged coast of the biggest state harbours the most incredible wildlife in America. We look at the creatures that endure the harsh reality of living along the shoreline.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:27:55', '2017-03-07 16:27:55'),
(504, '43ad0783-1618-42ae-8e57-7845ed30ce5c', 'Lion Gangland', 'In a remote corner of the Serengeti, a unique lion pride called \'Vumbi\' battles high heat, shortages of food and water and a dangerous rival coalition in its struggle to survive.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:27:55', '2017-03-07 16:27:55'),
(505, 'd329e0dd-edfc-4907-9ce1-edd37efec09b', 'Surviving The Serengeti', 'Surviving the Serengeti is a tale of courage and instinct of hope and desperation. Set in East Africa, the story is told against the backdrop of one of the most beautiful places on Earth. It is a journey of growth and survival.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:27:55', '2017-03-07 16:27:55'),
(506, 'f2c6a899-4ca3-4cd7-82f3-97abcac6c357', 'The Lakeshore Killers', 'Deep within Africa\'s heart lies the Zambezi valley. At the centre of this wilderness lies a great lake, an Eden like nowhere else on Earth. Here we meet three male lions: Takunda, Gombwe and Zindoga.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:27:55', '2017-03-07 16:27:55'),
