(508, '22fc28f8-4ad0-4abb-9e7b-718b1b6c258d', 'Tiger Queen', 'Discover the world of Indian tiger Machli and her cubs as they fight for survival and dominance in Ranthambore National Park.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:27:56', '2017-03-07 16:27:56'),
(509, '3cdfc1e5-d7c4-42f3-ba82-efb21da53a25', 'The Pack', '\'S1/E1 - Lions\'. A look at the strategies adopted by a pride of South African lions as they hunt zebras, impalas and giraffes in the Singita Game Reserve.', NULL, NULL, NULL, NULL, '1', '1', '2017-03-07 16:27:56', '2017-03-07 16:27:56'),
(510, '8e856889-e8a8-4f75-bd95-c16307020bc6', 'Hyena Queen', 'A true story of high drama in the Charleston clan, a family of spotted hyenas living on South Africa\'s Mala Mala Game Reserve. It\'s a family drama, rife with power struggles, intrigue, sex and clan politics.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:27:56', '2017-03-07 16:27:56'),
(511, 'fe1bd970-458e-4a77-9e14-56f55edfdd55', 'Winter Wonderland', 'When Jack Frost blankets the landscape there is magic in the air. For many, winter is a time for fun and festivities, but for our wild neighbours it\'s a challenging period where they will need all of their adaptions to survive.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:27:57', '2017-03-07 16:27:57'),
(512, 'e8cf09f0-f1e3-4542-9f10-7e0d88d9029c', 'Wild Winter', 'Wildlife around the globe fight tooth and nail to survive the winter season, against a striking frozen backdrop.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:27:57', '2017-03-07 16:27:57'),
(513, '589a14ba-374c-448d-ba01-af9e0446003e', 'World\'s Deadliest Animals', '\'S1/E3 - India\'. Living within India\'s arid deserts, lush jungles and rugged mountains is an elite group of twelve dangerous species equipped with an arsenal of predatory skills.', NULL, NULL, NULL, NULL, '1', '3', '2017-03-07 16:27:57', '2017-03-07 16:27:57'),
