(515, '14c4fe57-73d1-401e-b365-e0b49af8a366', 'Africa\'s Creative Killers', '\'S1/E1 - Coliseum\'. Predators\' tactics specifically fit the terrain they\'re hunting in. Get a close-up look at the killer skills of two of Africa\'s most iconic predators in northern Botswana - leopards and lions.', NULL, NULL, NULL, NULL, '1', '1', '2017-03-07 16:27:58', '2017-03-07 16:27:58'),
