(606, '47df0815-8389-4190-a6cd-1e6d8d49f990', 'Ax Men', '\'S8/E3 - Failure To Communicate\'. Coatsy\'s still out of commission, so Papac institutes an extremely dangerous process called \'shotgun logging\'. The team has doubled the yarders to up production, but they\'ve also doubled their trouble.', NULL, NULL, NULL, NULL, '8', '3', '2017-03-07 16:28:14', '2017-03-07 16:28:14'),
