(616, '6ad7f416-41fb-43ce-9fee-3d225944a1ba', 'Supercars', '\'S3/E19\'. The California T heralded a new era for Ferrari. The facelifted version is the first prancing horse to sport a turbo engine since the legendary F40, which was built in 1992. Even Ferrari can\'t avoid some downsizing.', NULL, NULL, NULL, NULL, '3', '19', '2017-03-07 16:28:15', '2017-03-07 16:28:15'),
(617, '8f161344-9740-4f4c-b71d-f19428145ed3', 'The Bike Show', '\'S2/E10 - 2/10\'. We bring you all the latest bikes released to the SA market. There\'s also news on the latest biking gadgets and features on the massive biking culture in South Africa.', NULL, NULL, NULL, NULL, '2', '10', '2017-03-07 16:28:16', '2017-03-07 16:28:16'),
(618, '5d26c51a-b4bd-4c71-82ed-7292af9ff2d8', 'Desert Collectors', '\'S1/E2\'. Nigel and Norm catch up with Graham Terry, at the Northam Swap Meet. People come from all over to buy and sell everything from automobile parts to advertising signs, antique petrol pumps to sewing machines and farm equipment.', NULL, NULL, NULL, NULL, '1', '2', '2017-03-07 16:28:16', '2017-03-07 16:28:16'),
(619, '35a9b66c-6e30-45d2-82ce-19960b0c7d3a', 'Grand Prix Greats', '\'S1/E5 - 1/5\'. Scotland\'s Jim Clark won the World Championship twice, he was a sublimely smooth, superbly slick driver who was said never to abuse the cars he drove to 25 Grand Prix victories.', NULL, NULL, NULL, NULL, '1', '5', '2017-03-07 16:28:16', '2017-03-07 16:28:16'),
(620, '7366fb80-03bc-4932-9154-85aebdc21eb3', 'AutoSpeed', '\'S2/E10 - 2/10\'. The new F1 cars hit the track, we cover the Renault and Sauber launches, we take a look back at the highly competitive DTM series from across Europe and chat with supercar contenders Jason Bright and Mark Winterbottom.', NULL, NULL, NULL, NULL, '2', '10', '2017-03-07 16:28:16', '2017-03-07 16:28:16'),
(621, 'cd74fee5-d53f-499b-8542-72c83452d97b', 'Thrill Seeker', '\'S2/E1\'. This week we are out at the Try Me Spin Arena in Kimberley to bring you all the spinning and stunts action from Kayla\'s Birthday Spin Bash.', NULL, NULL, NULL, NULL, '2', '1', '2017-03-07 16:28:16', '2017-03-07 16:28:16'),
(622, '57626787-d385-4257-b526-763146f2bdad', 'Auto Mundial', '\'S2/E10 - 2/10\'. We take a look at Subaru\'s seven seater Viziv and BMW\'s two and two halves seater - the 650i. Then, bigger and cheaper than Touareg, that\'s Atlas on a mission, and the timeless Bentley GT.', NULL, NULL, NULL, NULL, '2', '10', '2017-03-07 16:28:16', '2017-03-07 16:28:16'),
(623, '82a1c76d-790c-452a-b9a5-d3d861e129e1', 'Drive It!', '\'S2/E10\'. We take a look at the M7-60 Li XDrive, the annual upgrade for the Mazda 6, Fiat Chrysler\'s special model, the Cherokee Trailhawk and we compare five luxury sedans.', NULL, NULL, NULL, NULL, '2', '10', '2017-03-07 16:28:16', '2017-03-07 16:28:16');
