(624, 'cf3b6bb8-48c5-4848-945d-046892012d08', 'Road Madness', '\'S1/E4 - 1/4\'. Over-takers taking risks you won\'t believe, watch as these maniacs execute passing maneuvers that will have you wondering if they should be on our roads at all.', NULL, NULL, NULL, NULL, '1', '4', '2017-03-07 16:28:17', '2017-03-07 16:28:17'),
(625, '792826b1-c66f-45f4-becc-23f81cee9d27', 'American Trucker', '\'S2/E3 - 2/3\'. Considered a dying breed by some, independent owner-operators are still the backbone of the local and regional trucking industry.', NULL, NULL, NULL, NULL, '2', '3', '2017-03-07 16:28:17', '2017-03-07 16:28:17'),
(626, '536ee761-224c-4ef3-b54f-99bb7dd6cd22', 'Petrolheads', '\'S2/E9 - 2/9\'. We touch down in the Mother City for the inaugural Cape Town Motor Show. Bots shows off their next contender for Burnout Kings and we go shot gun in a Harper Type 5 Turbo.', NULL, NULL, NULL, NULL, '2', '9', '2017-03-07 16:28:17', '2017-03-07 16:28:17'),
(627, 'be6d4c22-0513-4673-9712-ef6f03747472', 'Dumbest Stuff On Wheels', '\'S1/E5 - 1/5\'. A tourist drives off an overpass, a tattooed biker takes a tumble and cars collide in the world\'s worst intersection.', NULL, NULL, NULL, NULL, '1', '5', '2017-03-07 16:28:17', '2017-03-07 16:28:17'),
(628, '42804bd6-4862-4421-9a39-63dd5321dc01', 'Champions: Jim Clark', '\'S1/E3 - 1/3\'. We look at the career of Jim Clark. From 72 starts, Clark won 27 Grand Prix - a success ratio only bettered by Fangio and Ascari - and he was World Champion, driving Lotus cars in 1963 and 1965.', NULL, NULL, NULL, NULL, '1', '3', '2017-03-07 16:28:17', '2017-03-07 16:28:17'),
(629, 'f52e4986-ba6c-44f8-8704-96d510937d9b', 'Champions: Didier Auriol', '\'S1/E1 - 1/1\'. Having been introduced to rallying in the late 70\'s, Frenchman Didier Auriol showed early promise and soon clinched his first major victory in 1985 with, as he put it, \'good times in a bad car\'.', NULL, NULL, NULL, NULL, '1', '1', '2017-03-07 16:28:17', '2017-03-07 16:28:17'),
(630, 'd07529cd-b15d-4dcb-9133-cce3972309e6', 'Supercars Exposed', '\'S2/E1 - 2/1\'. In the first episode, Tanner Foust applies for a job test driving Ferraris at the factory in Italy.', NULL, NULL, NULL, NULL, '2', '1', '2017-03-07 16:28:18', '2017-03-07 16:28:18'),
(631, '01a01831-4a2d-4e79-ba77-062c714e8cdf', 'Enginuity', '\'S5/E12\'. Mercedes-Benz takes a leap toward the future with the tenth generation E-Class. Chevrolet engineers have painstakingly selected the right materials for the new Silverado.', NULL, NULL, NULL, NULL, '5', '12', '2017-03-07 16:28:18', '2017-03-07 16:28:18'),
(632, '5d15f1a0-9065-4153-a240-d8a7ad0aa0e1', 'Put Your Car On TV', '\'S1/E7 - 1/7\'. Mylene and Saif chat to Alex Renner from ARM Motors Dubai and we feature the Chrysler SRT8, Chevrolet Camaro SS and Hummer H2.', NULL, NULL, NULL, NULL, '1', '7', '2017-03-07 16:28:18', '2017-03-07 16:28:18'),
(633, '307c6a19-4c93-4dda-ae9c-6f5810e2fc8f', 'Stunt Heroes', '\'S1/E10 - 1/10\'. Martial arts specialist, Ramazan, developed fight choreography. As four stuntmen disguised as agents \'attack\' him, will he be able to free himself? Find out in this episode of Stunt Heroes.', NULL, NULL, NULL, NULL, '1', '10', '2017-03-07 16:28:18', '2017-03-07 16:28:18'),
(634, '0caf2f8e-9a2b-4001-b374-1327fd299a41', 'Lizard Lick Towing', '\'S1/E2 - 1/2\'. When Ron confronts the county\'s most notorious crack pot, he\'s got to deal with Amy\'s scorn and the hot steel of a stone cold mad man, will they be able to hold Lizard Lick together?', NULL, NULL, NULL, NULL, '1', '2', '2017-03-07 16:28:18', '2017-03-07 16:28:18'),
(635, '42ef663d-ab99-4cbb-b856-4eecc8d592ed', 'Stuntbusters', 'Ultimate Flip - Garrett and Vanessa put a new spin on a gravity defying cable assisted car flip stunt.', 'http://ia.media-imdb.com/images/M/MV5BODczNjc3NDEyN15BMl5BanBnXkFtZTgwMDYwMTIzMjE@._V1_SX300.jpg', 'episode', 'tt2119874', 0, '1', '3', '2017-03-07 16:28:18', '2017-03-07 16:37:31'),
