(640, '881a762a-d7ab-4152-b265-74b8dddada53', '4x4 Offroad', '\'S2/E6\'. Bentley and Jaguar have joined the SUV party with the Bentayga and F-Pace. We look back when their luxury SUV concepts were unveiled. Are luxury SUVs unnecessary or uncompetitive? Or are they better than the others?', NULL, NULL, NULL, NULL, '2', '6', '2017-03-07 16:28:19', '2017-03-07 16:28:19'),
