(787, '73f4aed6-59df-4eb0-bf98-fdf0ec6945c9', 'Perfect Storms', 'God\'s Wrath - 1755. A powerful earthquake shakes the city of Lisbon. Survivors flee to the riverbank only to be engulfed by a massive tsunami. Fires burn for eight days. Tens of thousands die and Portugal is crippled as an imperial power.', 'N/A', 'episode', 'tt2860788', 0, '1', '5', '2017-03-07 16:28:45', '2017-03-07 16:37:36'),
(788, 'dcd1587b-ac58-44a0-83e8-faa1f6d241fb', 'Ancient X Files', '\'S2/E6 - Living Vampires\'. A mysterious burial 4 000 years ago and the recent discovery of a body with a missing heart leads to a search for the world\'s oldest vampire.', NULL, NULL, NULL, NULL, '2', '6', '2017-03-07 16:28:46', '2017-03-07 16:28:46'),
(789, '8ce4c284-c437-4cb2-bd4a-b60b942cd8e7', 'Drugs, Inc.', '\'S5/E7 - Dallas Dope Cowboys\'. Buyers are desperate to get hold of the Cartel\'s high quality product. They travel to Dallas giving local dealers the chance to make big money.', NULL, NULL, NULL, NULL, '5', '7', '2017-03-07 16:28:46', '2017-03-07 16:28:46'),
(790, '8bd6b44f-b29d-41b1-849f-913bcfef1baa', 'Wicked Tuna', '\'S3/E6 - Mission: Fishin!\'. It\'s a tight race for the coveted title of top-earning boat and everyone wants to dethrone the leader, Captain TJ Ott and his crew.', NULL, NULL, NULL, NULL, '3', '6', '2017-03-07 16:28:46', '2017-03-07 16:28:46'),
