(794, 'd5f0ecbd-350a-4b72-baab-225eae8d1313', 'How To Win At Everything', '\'S1/E1 - 1/1\'. We discover how to win at football freestyling, plus get some science tips on becoming a keepy uppy king from a pro. We explore a way that might increase the chance of potting from the get go.', NULL, NULL, NULL, NULL, '1', '1', '2017-03-07 16:28:47', '2017-03-07 16:28:47'),
(795, 'd4c5d195-d06b-41a9-b3f0-db334f1679bc', 'How To Win At Everything', '\'S1/E12 - 1/12\'. We learn how to pull a plane, drive on sand, swim faster, ride a one wheel bike and most crucially, chill wine with grapes.', NULL, NULL, NULL, NULL, '1', '12', '2017-03-07 16:28:47', '2017-03-07 16:28:47'),
(796, '312fe930-5747-4cea-9aa5-824e9815ad42', 'Brain Games', 'Money - This is a show about your brain and money. It\'s present in every corner of our lives-we earn it, spend it, manage it and often obsess over it, but how well do we really understand it? If ...', 'http://ia.media-imdb.com/images/M/MV5BNzM2ODc1NjYzMl5BMl5BanBnXkFtZTgwNDc4Mjk3NDE@._V1_SX300.jpg', 'episode', 'tt4425564', 7.8, '5', '4', '2017-03-07 16:28:47', '2017-03-07 16:37:37'),
(797, '54ad3fef-3e7b-44b2-ba3b-3bfb69a4655e', 'The Yard', '\'S1/E6 - Houseboat SOS\'. The job of building and maintaining the nation\'s fleet of fishing boats, work vessels and passenger ships is fraught with stress.', NULL, NULL, NULL, NULL, '1', '6', '2017-03-07 16:28:47', '2017-03-07 16:28:47'),
(798, '272c685a-4034-47d3-b2be-a2942f28414f', 'Perfect Storms', 'God\'s Wrath - 1755. A powerful earthquake shakes the city of Lisbon. Survivors flee to the riverbank only to be engulfed by a massive tsunami. Fires burn for eight days. Tens of thousands die and Portugal is crippled as an imperial power.', 'N/A', 'episode', 'tt2860788', 0, '1', '5', '2017-03-07 16:28:47', '2017-03-07 16:37:38'),
(799, '9edeae02-ad6d-482a-9218-28cf4539984c', 'Big, Bigger, Biggest', 'Tower - N/A', 'N/A', 'episode', 'tt1991371', 0, '3', '5', '2017-03-07 16:28:47', '2017-03-07 16:37:38'),
(800, '3ffaa073-a9e3-4ca5-bfbc-d1ccfd52cb7f', 'Megafactories', '\'S1/E48 - Mv Agusta\'. MV Agusta is a legendary Italian motorcycle manufacturer. Purchased by a father and son team, the company is now betting its future on a brand new motorcycle design.', NULL, NULL, NULL, NULL, '1', '48', '2017-03-07 16:28:47', '2017-03-07 16:28:47'),
(801, '1c78429a-0688-4dfd-8004-23d827142e20', 'Air Crash Investigation', '\'S13/E6 - The Death Of JFK Jr\'. The celebrity son of JFK disappeared along with his plane in 1999. Investigators soon found the wreckage, but what brought the aircraft down?', NULL, NULL, NULL, NULL, '13', '6', '2017-03-07 16:28:48', '2017-03-07 16:28:48'),
