(943, '6ef2fad2-4c55-47fc-b18c-b5458a973318', '4x4 Offroad', '\'S2/E6\'. Bentley and Jaguar have joined the SUV party with the Bentayga and F-Pace. We look back when their luxury SUV concepts were unveiled. Are luxury SUVs unnecessary or uncompetitive? Or are they better than the others?', NULL, NULL, NULL, NULL, '2', '6', '2017-03-07 16:29:17', '2017-03-07 16:29:17'),
(944, '5d4869d9-6f4c-402e-9137-35f796146d44', 'Buyer\'s Guide', '\'S2/E10 - 2/10\'. We look for a hatchback between R300 - R350 000 - the options are endless! A mommy is looking for a good second hand transporter, and in our best buys, we\'re helping students with their first car choices.', NULL, NULL, NULL, NULL, '2', '10', '2017-03-07 16:29:18', '2017-03-07 16:29:18'),
