(947, '5af67df1-e5f3-4f62-b0db-6040a12f3707', 'Lizard Lick Towing', '\'S1/E2 - 1/2\'. When Ron confronts the county\'s most notorious crack pot, he\'s got to deal with Amy\'s scorn and the hot steel of a stone cold mad man, will they be able to hold Lizard Lick together?', NULL, NULL, NULL, NULL, '1', '2', '2017-03-07 16:29:18', '2017-03-07 16:29:18'),
(948, '9bec9676-9afc-4881-838c-9aaecff05e62', 'Stuntbusters', 'Ultimate Flip - Garrett and Vanessa put a new spin on a gravity defying cable assisted car flip stunt.', 'http://ia.media-imdb.com/images/M/MV5BODczNjc3NDEyN15BMl5BanBnXkFtZTgwMDYwMTIzMjE@._V1_SX300.jpg', 'episode', 'tt2119874', 0, '1', '3', '2017-03-07 16:29:19', '2017-03-07 16:38:44'),
(949, '260fe330-64a9-414b-8f32-e5a9e24efd38', 'Ultimate Racing', '\'S1/E4\'. In this episode we bring you all the race highlights from the SA VS UK invitational event recently held at the Ultimate Raceway in Vereeniging.', NULL, NULL, NULL, NULL, '1', '4', '2017-03-07 16:29:19', '2017-03-07 16:29:19'),
(950, '4a3f496c-3d74-4fc7-9126-f8a1ae53d125', 'Supercars', '\'S3/E19\'. The California T heralded a new era for Ferrari. The facelifted version is the first prancing horse to sport a turbo engine since the legendary F40, which was built in 1992. Even Ferrari can\'t avoid some downsizing.', NULL, NULL, NULL, NULL, '3', '19', '2017-03-07 16:29:19', '2017-03-07 16:29:19'),
(951, '2eabd142-68bd-4f32-9487-615a6a28689b', 'The Bike Show', '\'S2/E10 - 2/10\'. We bring you all the latest bikes released to the SA market. There\'s also news on the latest biking gadgets and features on the massive biking culture in South Africa.', NULL, NULL, NULL, NULL, '2', '10', '2017-03-07 16:29:19', '2017-03-07 16:29:19'),
(952, '0062dcba-7012-45ae-8534-d7e6a21287d5', 'Grand Prix Greats', '\'S1/E5 - 1/5\'. Scotland\'s Jim Clark won the World Championship twice, he was a sublimely smooth, superbly slick driver who was said never to abuse the cars he drove to 25 Grand Prix victories.', NULL, NULL, NULL, NULL, '1', '5', '2017-03-07 16:29:19', '2017-03-07 16:29:19'),
(953, '1d622659-e965-4548-8c09-04ba27675ede', 'Put Your Car On TV', '\'S1/E7 - 1/7\'. Mylene and Saif chat to Alex Renner from ARM Motors Dubai and we feature the Chrysler SRT8, Chevrolet Camaro SS and Hummer H2.', NULL, NULL, NULL, NULL, '1', '7', '2017-03-07 16:29:20', '2017-03-07 16:29:20'),
(954, '904a6227-4189-4e8d-937c-b2b62d6efd21', 'Stunt Heroes', '\'S1/E10 - 1/10\'. Martial arts specialist, Ramazan, developed fight choreography. As four stuntmen disguised as agents \'attack\' him, will he be able to free himself? Find out in this episode of Stunt Heroes.', NULL, NULL, NULL, NULL, '1', '10', '2017-03-07 16:29:21', '2017-03-07 16:29:21'),
(955, 'f4224873-caf9-4c12-b91a-cbf5510a07d5', 'AutoSpeed', '\'S2/E10 - 2/10\'. The new F1 cars hit the track, we cover the Renault and Sauber launches, we take a look back at the highly competitive DTM series from across Europe and chat with supercar contenders Jason Bright and Mark Winterbottom.', NULL, NULL, NULL, NULL, '2', '10', '2017-03-07 16:29:21', '2017-03-07 16:29:21'),
(956, 'cd69e4dd-cc8e-4345-8a8e-4b214d3d4494', 'Thrill Seeker', '\'S2/E1\'. This week we are out at the Try Me Spin Arena in Kimberley to bring you all the spinning and stunts action from Kayla\'s Birthday Spin Bash.', NULL, NULL, NULL, NULL, '2', '1', '2017-03-07 16:29:21', '2017-03-07 16:29:21'),
(957, '190ffe31-2fc0-4fb0-b0f3-344a59ebe1c3', 'IGNITION GT', '\'S2/E10 - 2/10\'. Brenwin finds out whether the Mitsubishi Triton can stake its claim in the SA bakkie market. Maserati\'s new Levante is set to create a sizeable hole in many a well-heeled pocket. Four premium hatchbacks go head to head.', NULL, NULL, NULL, NULL, '2', '10', '2017-03-07 16:29:22', '2017-03-07 16:29:22'),
(958, '711cecd1-ad13-4eda-9eed-554352e49e29', 'Desert Collectors', '\'S1/E2\'. Nigel and Norm catch up with Graham Terry, at the Northam Swap Meet. People come from all over to buy and sell everything from automobile parts to advertising signs, antique petrol pumps to sewing machines and farm equipment.', NULL, NULL, NULL, NULL, '1', '2', '2017-03-07 16:29:22', '2017-03-07 16:29:22'),
(959, 'd8d5981b-7be2-45e0-842c-6a2d0bbdbdb8', 'Perfect Ride', '\'S1/E2 - 1/2\'. Race dads and their sons and daughters: Verena runs in an extraordinary race, not only against one but three race drivers - Hans-Joachim Stuck and his two sons.', NULL, NULL, NULL, NULL, '1', '2', '2017-03-07 16:29:22', '2017-03-07 16:29:22'),
(960, '8d640988-121c-4bfe-b972-4f2ea15f519e', 'Supercars', '\'S1/E34 - 1/34\'. This episode brings you highlights from the 2012 Geneva Salon. The secret star was the Pagani Huayra, a real hypercar from Italy. We also look at the Ferrari F12 Berlinetta with 12 cylinders and 740 horsepower.', NULL, NULL, NULL, NULL, '1', '34', '2017-03-07 16:29:22', '2017-03-07 16:29:22'),
(961, 'b85e2525-7cca-41d2-84dd-67980e0296ef', 'Champions: Jim Clark', '\'S1/E3 - 1/3\'. We look at the career of Jim Clark. From 72 starts, Clark won 27 Grand Prix - a success ratio only bettered by Fangio and Ascari - and he was World Champion, driving Lotus cars in 1963 and 1965.', NULL, NULL, NULL, NULL, '1', '3', '2017-03-07 16:29:22', '2017-03-07 16:29:22'),
(962, '404b3aff-83d0-4edd-ae2d-92b197d499da', 'Champions: Didier Auriol', '\'S1/E1 - 1/1\'. Having been introduced to rallying in the late 70\'s, Frenchman Didier Auriol showed early promise and soon clinched his first major victory in 1985 with, as he put it, \'good times in a bad car\'.', NULL, NULL, NULL, NULL, '1', '1', '2017-03-07 16:29:23', '2017-03-07 16:29:23'),
(963, '21566765-e5c7-4785-a7ce-4f9541f97c58', 'Made In Germany', '\'S1/E5 - 1/5\'. The BMW Group is the industry leader in environmentally friendly production and sustainability. We examines the company\'s manufacturing techniques and facilities to find out why they have less impact on the planet.', NULL, NULL, NULL, NULL, '1', '5', '2017-03-07 16:29:23', '2017-03-07 16:29:23'),
(964, 'd001b0ac-c64b-45fc-bfb7-8d4f889bf103', 'Four-Wheel Drive', '\'S6/E7\'. The Range Rover Classic is one of the most beautiful cars ever created, and for Andrew\'s birthday he took a Suffix-A Range Rover (from the first production run) for a trip around beautiful Wales.', NULL, NULL, NULL, NULL, '6', '7', '2017-03-07 16:29:23', '2017-03-07 16:29:23'),
(965, '1a35dc56-95f5-495d-9e04-f025ca42c117', 'Petrolheads', '\'S2/E9 - 2/9\'. We touch down in the Mother City for the inaugural Cape Town Motor Show. Bots shows off their next contender for Burnout Kings and we go shot gun in a Harper Type 5 Turbo.', NULL, NULL, NULL, NULL, '2', '9', '2017-03-07 16:29:23', '2017-03-07 16:29:23'),
(966, '4b580240-33e8-4895-a1bc-ca6ddae7aea9', 'Dumbest Stuff On Wheels', '\'S1/E5 - 1/5\'. A tourist drives off an overpass, a tattooed biker takes a tumble and cars collide in the world\'s worst intersection.', NULL, NULL, NULL, NULL, '1', '5', '2017-03-07 16:29:23', '2017-03-07 16:29:23'),
