(1047, 'd68aeb6d-7d74-4c1f-94d7-781af8fa65aa', 'How To Get Away With Murder', 'Call It Mother\'s Intuition - Annalise and her students take on a case of conspiracy to murder by two siblings, as Frank\'s actions lead to painful consequences.', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMzE1MTQxMDg0NF5BMl5BanBnXkFtZTgwNTUwNjI1MDI@._V1_SX300.jpg', 'episode', 'tt5563356', 8.7, '3', '7', '2017-03-07 16:29:38', '2017-03-07 16:38:54'),
(1048, '3273307b-9fa3-434e-a13c-0e942afd3265', 'Anomalisa', 'This Oscar-nominated animation takes a look at the meaning of life, through the eyes of a man who questions the mundanity of his day-to-day experiences.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:38', '2017-03-07 16:29:38'),
(1049, 'f902e0db-3315-4ea6-967e-9d97764cd0dd', 'The Last Witch Hunter', 'Vin Diesel battles a great and dark evil in this supernatural action film. A witch hunter is all that stands between humanity and a powerful, terrifying coven.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:39', '2017-03-07 16:29:39'),
(1050, '70c08212-c7f9-40d1-bb9f-49c76160057a', 'A Doggone Christmas', 'What happens when you mix spies and dogs? You get a canine, family adventure. A telepathic dog is wanted by the CIA, and his new owners get caught up in the madness.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:39', '2017-03-07 16:29:39'),
(1051, 'b048b305-8e05-4de4-a3c0-5d6574f4f0ee', 'Jessica Darling\'s It List', 'The harsh world of high school is shown in this fun teen movie. A girl\'s older sister gives her a list of instructions on how to be popular, but it\'s harder than it looks.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:39', '2017-03-07 16:29:39'),
(1052, 'ecd72b0e-da7a-44a2-aa05-0224a74b6eae', 'Home Invasion', 'A thriller filled with tension and danger. A woman is forced her to fight for her survival when a trio of professional thieves break into her mansion.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:39', '2017-03-07 16:29:39'),
(1053, '04a60da2-c027-4912-8161-9efcef608c41', 'Before We Go', 'Chris Evans (The Avengers) makes his directorial debut with this romcom. Two strangers, brought together by circumstance, grow close to each other through a string of events.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:39', '2017-03-07 16:29:39'),
(1054, 'c0e08992-94f9-4b20-a362-aeb958f40d4c', 'Annabelle Hooper And The Ghosts Of...', 'Annabelle Hooper And The Ghosts Of Nantucket. A teenage writer and her friends set out to solve the mystery behind a legendary ghost story, in this fun-filled adventure.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:40', '2017-03-07 16:29:40'),
(1055, 'e85574c1-0b66-4b32-9a2a-e306e378c2b6', 'Dare To Be Wild', 'A biographical film brimming with inspiration and heart. A woman with a passion for gardening enters the Chelsea Flower Show as an underdog only to transform it completely.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:40', '2017-03-07 16:29:40'),
(1056, '0d49eb78-9136-4993-83d9-967ca1269299', 'Raising The Bar', 'A family sports film about friendship and hope. After her leg was broken by a rival, a teenager moves to Australia. There she helps her new friend train to beat her old foe.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:40', '2017-03-07 16:29:40'),
(1057, 'c79e2a3d-f6d6-4dc3-ab5f-041237d78ef9', 'Hail, Caesar!', 'The award winning Coen brothers direct George Clooney and an all-star cast in this comedic drama. A Hollywood fixer is hired to keep the stars of a studio in line.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:40', '2017-03-07 16:29:40'),
(1058, 'cfac17df-b071-4e57-a260-90eec5cae23c', 'Goosebumps', 'Based on the children\'s stories, this adventure follows a teenager who teams up with horror author, R.L. Stine, to save his town from monsters that are set free from the books.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:40', '2017-03-07 16:29:40'),
(1059, 'b7579ca9-61fe-4d3d-b542-caf7ef3b4a66', 'Barbershop: A Fresh Cut', 'This star-studded ensemble will have you in stitches as Ice Cube returns to the barbershop. This time they fight to keep the community safe from gang violence.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:41', '2017-03-07 16:29:41'),
(1060, '48b5f81d-aca4-4795-ba5f-a6d5505b9487', 'The Dressmaker', 'A quirky Australian dramedy about change and acceptance, starring Oscar winner Kate Winslet. A woman returns to her small town to silence her naysayers and transform its people.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:41', '2017-03-07 16:29:41'),
(1061, 'edfdc2b4-75e4-4144-a918-aaaad93b2ffe', 'The Hateful Eight', 'Quentin Tarantino creates a hard hitting Western with a stellar cast. A bounty hunter and his prisoner are trapped in a cabin during a blizzard with a group of nasty characters.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:42', '2017-03-07 16:29:42'),
(1062, 'd7dff370-a5e1-496c-ae74-2384814c97d1', 'Whitney Cummings: I\'m Your Girlfriend', 'Comedienne Whitney Cummings gets naughty and nasty with strings of forward adult jokes. If you love irreverent stand-up, you\'ll be in stitches.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:42', '2017-03-07 16:29:42'),
(1063, '92b404f4-55ef-46e2-bb80-45286c3d23f8', 'Behind The Scenes: Mandela: Long...', 'Behind The Scenes: Mandela Long Walk To Freedom. Go behind the scenes of the movie \'Mandela: Long Walk To Freedom\'.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:42', '2017-03-07 16:29:42'),
(1064, '63c7beda-c5ab-402c-9961-7ab1bb1a820f', 'Lay The Favorite', 'Bruce Willis leads an all-star cast in this dramedy about a woman who becomes a married gambler\'s good-luck charm - that is, until his wife finds out about it.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:43', '2017-03-07 16:29:43'),
(1065, 'e27aef11-0a3b-464b-bd56-be631b357c14', 'Behind The Scenes: My Big Fat Greek...', 'Behind The Scenes: My Big Fat Greek Wedding 2. We go behind the scenes of \'My Big Fat Greek Wedding 2\'.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:43', '2017-03-07 16:29:43'),
(1066, '72eea2af-64d9-4786-9cb4-f296d9b66b7a', '#Lucky Number', 'All hell breaks loose in this crazy comedy about a man who ends up with the old number of a basketball star and proceeds to live his life.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:43', '2017-03-07 16:29:43'),
(1067, 'daada72a-c8cb-4486-9bde-a438f17c14a6', 'The Wizard', 'Two brothers and their love for video games leads them on an unforgettable adventure in this charming film. They run away from home to enter the ultimate video game championship.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:43', '2017-03-07 16:29:43'),
(1068, '0bfa6da5-b494-43df-afea-ed0f900eecb4', 'Sammy\'s Adventures 2', 'A touching animation with a message. A sea turtle spends 50 years travelling the world. Over the course of his travels he slowly sees the effects of global warming.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:44', '2017-03-07 16:29:44'),
(1069, 'a7581037-dcb1-4ff0-b03f-e3ebff300d27', 'Barbie: Princess Charm School', 'In this enchanting adventure a princess and her friends go on a journey of truth, as they look for a special crown to prove the princess\'s royal lineage.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:44', '2017-03-07 16:29:44'),
(1070, 'd1f6f9b9-485a-44f9-b485-e6d17b3c3ac7', 'Barbie As Rapunzel', 'The whimsical, magical animation that fuses Barbie and Rapunzel. A princess who is locked away in a castle tries to paint her way out in order to save her prince.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:44', '2017-03-07 16:29:44'),
(1071, 'ebfeab70-2976-4eae-818f-81e0b33a5fbe', 'Dolphin Tale 2', 'Morgan Freeman and Ashley Judd star in this family tale about friendship as a group of people in a marine hospital try and help a dolphin find a companion.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:45', '2017-03-07 16:29:45'),
(1072, 'cb04df3c-373d-4caa-b250-4eb229fc4845', 'On Angel\'s Wings', 'Choices must be made in this teen movie. A girl struggling with high school and soccer gets a visit from an angel that gives her three wishes, but will she use them wisely?', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:45', '2017-03-07 16:29:45'),
(1073, '606938dd-6e62-4cea-bbef-5239bdb761fa', 'So Undercover', 'Miley Cyrus goes undercover for this colourful teen comedy. A teenage private investigator is hired to protect a college student, but she isn\'t quite prepared for sorority life.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:45', '2017-03-07 16:29:45'),
