(1075, 'd9b46dd1-95ec-4ce4-93e2-6f85000198e7', 'Tarzan', 'This animated adventure of classic hero sees Tarzan and Jane battle a mercenary army sent to destroy the jungle looking for a meteor that has a new power source.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:45', '2017-03-07 16:29:45'),
(1076, 'f495804e-1548-4c87-a71d-019d7152b255', 'Shrek The Third', 'Mike Myers and the all-star cast return for a third instalment to the franchise. After the king falls ill, Shrek and Fiona must defend the kingdom from Prince Charming.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:46', '2017-03-07 16:29:46'),
(1077, '7593b54d-cd22-43b9-9d6a-41d6acbfc97f', 'Shanghai Knights', 'In this sequel to the action comedy \'Shanghai Noon\', dynamic duo Chon and Roy bring their flying kicks to London to catch an escaped killer at the centre of a massive conspiracy.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:46', '2017-03-07 16:29:46'),
(1078, 'b2ff52a0-80c1-4a16-b6a6-4a349e7e18e7', 'Grumpier Old Men', 'In the smash hit\'s hilarious sequel, the grumpy old men encounter a problem - in the form Sophia Loren, a feisty lady who wants to turn their beloved bait shop into a restaurant.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:46', '2017-03-07 16:29:46'),
(1079, '63bbacd2-fbc5-44ef-9c6d-559c7f92a7e1', 'The Intruders', 'A horror movie filled with paralysing fear and a dark twist. A woman suffering from agoraphobia has to face a trio of home invaders, but they are in for a nasty surprise.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:46', '2017-03-07 16:29:46'),
(1080, 'fd63323b-3cd4-4389-9411-230c138bc409', 'American Ultra', 'Jesse Eisenberg (Rio) and Kristen Stewart (Twilight) fight to survive in this action comedy. A stoner secret agent and his girlfriend go on the run when he\'s marked for death.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:46', '2017-03-07 16:29:46');
