(1086, '469faf2b-e058-4ecb-bb0c-b8cc81eb7e21', 'Exodus: Gods And Kings', 'Director Ridley Scott (Gladiator), helms this biblical epic staring Oscar winners Christian Bale and Ben Kingsley that retells the amazing story of Moses and the Exodus.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:48', '2017-03-07 16:29:48'),
