(1088, '30d706c7-6548-4b0a-ad64-2522f864bec8', 'American Justice', 'Explore the groundbreaking criminal cases with an inside look at a selected case through the eyes of those directly involved, ranging from law enforcement officers to the victims.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:48', '2017-03-07 16:29:48'),
(1089, 'a3618210-277d-435f-9627-f015dc535ea7', '13', 'Jason Statham is part of a deadly game in this tense thriller about a naïve young man who gets sucked into a criminal underworld laden with death, violence and money.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:48', '2017-03-07 16:29:48'),
(1090, '81c39025-c2da-4317-804a-a27653b01e35', 'Mad Max: Fury Road', 'Oscar-winning director George Miller, Tom Hardy and Charlize Theron bring the post-apocalyptic world of \'Mad Max\' back to life. Max must help save a group of women from a warlord.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:48', '2017-03-07 16:29:48'),
(1091, 'bc29b395-3234-4eb6-87db-3997f86b7863', 'Misfire', 'Martial arts expert Gary Daniels stars in this pulsating, action-packed film. A veteran DEA agent travels to Mexico to save his ex-wife, who was abducted by a cartel boss.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:49', '2017-03-07 16:29:49'),
(1092, 'f8cbff44-f44a-4f4c-a104-8c8e5da8c283', 'Momentum', 'Olga Kurylenko (Hitman) and James Purefoy (Rome) face off in this action thriller. A master thief is hunted by a deadly assassin after she steals a top-secret hard drive.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:49', '2017-03-07 16:29:49'),
(1093, 'a63e5408-e0b3-46b3-92db-f3c1f0d6cc6d', 'Contraband', 'A former smuggler is forced to pull off one more contraband deal when his brother-in-law gets in trouble. Things quickly fall apart though, putting his wife and son in danger.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:49', '2017-03-07 16:29:49'),
(1094, 'a920e18a-52a2-4c43-aac2-7ffd65de055c', 'Roepman', 'A poignant coming-of-age South African film set during the 1960s. An eleven-year-old boy befriends an unlikely hero whose acts of kindness see him through his journey into adulthood.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:49', '2017-03-07 16:29:49'),
(1095, '749740dd-15a3-4848-a0c1-6514762680bd', 'Elizabeth: The Golden Age', 'Cate Blanchett leads a great cast as she gives a breath-taking performance in this gripping period drama, that tells tumultuous historical trials and triumphs of Queen Elizabeth.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:29:49', '2017-03-07 16:29:49'),
