(2782, '1dfe8cf4-b25e-4b41-a504-0471f9a791b6', 'Het Instituut', '\'S1/E3 - Humor\'. Wat gebeurt er als je een kazerne ombouwt tot wetenschappelijk instituut en er honderd mensen in opsluit met Joep van Deudekom en Rob Urgert? Sophie Hilbrand helpt.', NULL, NULL, NULL, NULL, '1', '3', '2017-03-07 16:33:31', '2017-03-07 16:33:31'),
