(2790, '9c0700fb-b2af-4d25-8a6a-2c742e2db3c4', 'Les Escapades De Petitrenaud', '\'S1 - Dax\'. Jean-Luc Petitrenaud et Jérôme Fillol nous font découvrir le marché friand de Dax. Au menu, les spécialités locales : le foie gras en pot au feu, la parillade de poisson, le célèbre gâteau basque à la crème.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:32', '2017-03-07 16:33:32'),
(2791, '838c10b6-c974-4a6d-9e52-c5244bb0d334', 'Manger Le Monde', '\'S1 - Thaïlande - Bangkok\'. Bruno est de retour chez lui, à Bangkok. Il débute la visite par le plus vieux marché aux saveurs inédites, puis direction le Soi 38 de Sukhumvit, le quartier incontournable pour sa restauration de rue.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:32', '2017-03-07 16:33:32'),
