(2793, '6200e196-65dc-42cf-9d2b-7d38f4587065', 'Internationales', '\'S1 - Monseigneur Pascal Gollnisch\'. Invité : Monseigneur Pascal Gollnisch, prélat catholique français, directeur général de l\'Oeuvre d\'Orient. Pour les chrétiens d\'Orient, le dilemme est simple et terrible à la fois : rester ou partir.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:32', '2017-03-07 16:33:32'),
(2794, '684ebd04-0904-4153-943b-bfa723fdc62a', 'Geopolitis', '\'S1 - Kaliningrad, 3e Guerre Mondiale ?\'. Dans l\'enclave russe de Kaliningrad et les pays alentours, à l\'est de l\'Europe, les scénarios de guerre se multiplient. Jamais depuis la fin de la Guerre froide les tensions n\'ont été aussi vives.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:32', '2017-03-07 16:33:32'),
