(2802, '01028768-2f19-41c0-8b44-3ba121aab09c', 'Waga Love', '\'S1 - L\'Autre Femme\'. La femme de l\'ancien propriétaire, Adja, reçoit la visite de tante Téné, venue du village pour régler les problèmes du couple. Pendant ce temps, Robert reçoit la visite de ses beaux-parents.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:32', '2017-03-07 16:33:32'),
