(2804, 'e325b790-c54f-48ef-ada3-1737f19c0f51', 'Les Bobodiouf Le Retour', '\'S1 - La Moto De Tonton Brama\'. Damité et Soumbala sont venus récupérer la pension des villageois. Ils en profitent pour faire le tour de la famille. Tonton Brama assemble des tubes devant sa vieille moto. Salif est chez sa maîtresse.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:32', '2017-03-07 16:33:32'),
(2805, '056231e3-0344-4ffb-a15f-7f216dbe6076', 'Plus Belle La Vie', 'Chroniques de la vie quotidienne au Mistral, quartier populaire de Marseille, avec ses joies, ses drames, ses histoires d\'amour et de haine, ses secrets.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:32', '2017-03-07 16:33:32'),
