(2807, '1273b636-c850-4a59-8886-1bd0a55cd932', 'Tout Le Monde Veut Prendre Sa Place', '\'S1\'. Le jeu où tout le monde peut devenir champion. Un quiz, six candidats et, bien calé dans son fauteuil, un champion que tous rêvent de déloger! Présenté par Nagui.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:32', '2017-03-07 16:33:32'),
(2808, 'b2746773-212a-4c8d-940a-2303914eac87', 'Épicerie Fine - Terroirs Gourmands', '\'S1 - Sardine Et Bonotte Du Marais Breton Vendéen\'. Dans le Centre-Ouest de la France, le port de Saint-Gilles-Croix-de-Vie est animé par les pêcheurs de sardines. Le temps d\'une fête, le poisson argenté rejoint chaque année la bonotte.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:32', '2017-03-07 16:33:32'),
(2809, '971806a4-0783-4d25-85fc-510761b1c62e', 'S\'Il N\'En Restait Qu\'Une', '\'S15 - Yannick Alléno\'. Yannick Alléno a commencé à travailler en cuisine à l\'âge de 15 ans: il évoque son pain de brochet, un plat constitué de brioche, de poisson et d\'une purée de céleri.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:33', '2017-03-07 16:33:33'),
(2810, '3d28120f-c9a7-48a5-98b2-a674f24afc9c', 'In Situ', '\'S1 - Les Animaux : Une Fascination Qui Rapporte Gros\'. Sauvages ou domestiques, les Français adorent les animaux de compagnie et dépensent chaque année 4,3 milliards d\'euros pour leur bien-être.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:33', '2017-03-07 16:33:33'),
(2811, '7376868d-26d3-421f-afc6-f1a2e2131e62', 'Des Chiffres Et Des Lettres', '\'S1\'. Jeu basé sur la connaissance du vocabulaire avec \'le mot le plus long\' et sur les compétences en calcul avec \'le compte est bon. Présenté par Laurent Romejko, avec Arielle Boulin-Prat et Bertrand Renard.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:33', '2017-03-07 16:33:33'),
