(2814, 'e9d87f7b-92dc-454e-9a67-526021745ec9', 'Tendance XXI', '\'S1\'. La créativité française s\'exprime dans la mode, le design, la beauté ou encore la gastronomie. Tendance XXI montre l\'évolution de ces milieux à travers le temps.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:33', '2017-03-07 16:33:33'),
(2815, '1bb70b6d-3a7d-4f63-a256-650fd09ec704', 'La Smala S\'En Mêle', '\'S1 - Merci Du Cadeau\'. Le divorce est prononcé, la garde des enfants récupérée: Isabelle et Franck vont enfin pouvoir se marier. Avant, Isabelle veut rencontrer ses futurs beaux-parents.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:33', '2017-03-07 16:33:33'),
(2816, 'dc9f48e9-13de-49b5-be49-0f7145508bef', 'La Mère À Boire', 'Dans un lotissement, une voiture à l\'arrêt. À l\'intérieur, Ariane et son fils, Thomas, semblent guetter quelqu\'un. Lorsqu\'une dame apparaît dans la rue, Ariane est pétrifiée.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:33', '2017-03-07 16:33:33'),
(2817, 'aae22b30-d166-4e42-a4a1-2ccd06e8e571', 'Afrique Plurielle', '\'S1\'. Émission composée d\'un documentaire montrant les différentes facettes de l\'Afrique et d\'une production propre du CIRTEF, \'Franc parler\', qui donne la parole à des personnalités issues de différents milieux.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:33', '2017-03-07 16:33:33'),
(2818, 'ff52cfdc-a130-4de5-917d-a95d2f0128cc', 'Le Dessous Des Cartes', '\'S1 - Le Transport Maritime, Coeur De La Mondialisation\'. Rarement sous le feu des projecteurs, le transport maritime est pourtant un marché gigantesque et un pilier indispensable au fonctionnement de l\'économie mondiale.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:33', '2017-03-07 16:33:33'),
