INSERT INTO `programinfo` (`id`, `programid`, `title`, `description`, `programimage`, `programtype`, `imdb_id`, `imdb_rating`, `season_id`, `episode_id`, `date_created`, `date_updated`) VALUES
(2956, 'a50ccded-7114-4a8f-ae09-da7ff7d7f74a', 'DC\'s Legends Of Tomorrow', '\'S2/E13 - Land Of The Lost\'. After the murders of his family, time master Rip Hunter travels back in time to the present day where he brings together a team of heroes and villains to prevent more killings.', NULL, NULL, NULL, NULL, '2', '13', '2017-03-07 16:33:39', '2017-03-07 16:33:39'),
(2957, '6093adf1-39d4-40c5-ad98-6c84d442100d', 'Emerald City', 'Episode #1.10 - N/A', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTk5NTA1NzkyNV5BMl5BanBnXkFtZTgwNzk1MDM3MDI@._V1_SX300.jpg', 'episode', 'tt4897640', 0, '1', '10', '2017-03-07 16:33:39', '2017-03-07 16:40:20'),
(2958, 'fc6697cf-c098-43e3-88c2-251a317ea436', 'Kicking Off', 'How far are you willing to go to get your revenge? In this laugh a minute British comedy, two football fans kidnap the referee that cost their team a place in the league.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:39', '2017-03-07 16:33:39'),
(2959, 'd7e510c1-02ff-421d-8b01-ed2287869898', 'Ratter', 'In a world surrounded by technology, are we really ever alone? A frightening and very real thriller about a woman who is being stalked by a hacker.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:39', '2017-03-07 16:33:39'),
(2960, 'e3d24cb0-ee35-42ab-bdf7-627d2be6011c', 'Gutshot Straight', 'In this action film starring Steven Seagal, a small-time gambler trying to make a quick buck finds himself caught in the middle of a setup that could cost him his life.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:39', '2017-03-07 16:33:39'),
(2961, '197c1b0b-692d-4732-8df2-35afafe96569', 'Zoolander 2', 'Ben Stiller and Owen Wilson return for this sequel to their 2001 smash hit. The two models are trying to make a comeback but instead are sucked into a sinister conspiracy.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:39', '2017-03-07 16:33:39'),
(2962, 'c23a685b-f18b-4ff4-b6fa-d927f3543744', 'The 5th Wave', 'Chloë Grace Moretz (Kick-Ass) drives this pulsating sci-fi. Earth has gone through four deadly alien attacks and a young woman is trying to save her brother before the fifth wave.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:39', '2017-03-07 16:33:39'),
(2963, 'a3ea2832-1223-4854-a46d-f7e1b1c31491', 'Suffragette', 'A truly compelling biographical film with a stellar cast led by Carey Mulligan. Follow the powerful movement that gave women strength and the right to vote.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:39', '2017-03-07 16:33:39'),
(2964, '48a41e8d-19f6-4d17-ae0c-af7413cfc9e3', 'A Perfect Day', 'Benicio Del Toro and Tim Robbins risk life and limb for their fellow man in this drama set during the war in the Balkins. Aid workers work in a war zone to resolve a crisis.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:39', '2017-03-07 16:33:39'),
(2965, 'f617b514-866f-4fc0-b5b5-c36059e82b2f', 'The Lady In The Van', 'The talented Oscar-winning Maggie Smith stars in this charming British drama. A man befriends a transient woman who lives in a van and decides to park it in his driveway.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:39', '2017-03-07 16:33:39'),
(2966, '9806568a-270b-4c82-aaca-d302ba34be34', 'In The Heart Of The Sea', 'Award-winning director Ron Howard and Chris Hemsworth take on the deep blue sea and its dark secrets. Inspired by the real-life tale of a ship that took on a monstrous whale.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:39', '2017-03-07 16:33:39'),
(2967, 'ca2af6e9-c8f9-4702-8e9e-1da8acf5c6bb', 'War Room', 'Appearances can be deceiving in this drama. A seemingly perfect family with deep underlying problems go to a medium for help.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:39', '2017-03-07 16:33:39'),
(2968, '351e3dd5-4042-4302-8963-66ff86b7b8a1', 'Hello, My Name Is Doris', 'The multi-Oscar winner Sally Field gives a real performance in this charming romcom. A sixty-something woman takes a chance with a far younger co-worker.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:39', '2017-03-07 16:33:39'),
(2969, 'd88abeff-0c2b-4ae3-b02e-5341a1ad087b', 'Deadpool', 'An anti-hero film that breaks the superhero movie mould. Ryan Reynolds drives this grizzly yet funny film about a mercenary who is on a revenge mission after being experimented on.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:39', '2017-03-07 16:33:39'),
(2970, 'ac2284ed-a605-412b-bbc9-83e0015ad98a', 'Eddie The Eagle', 'Taron Egerton and Hugh Jackman tell the awe-inspiring story of the famous and tenacious British athlete. An underdog takes the 1988 Winter Olympics by storm with his pure will.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:39', '2017-03-07 16:33:39'),
(2971, 'eac4d191-0ad6-4541-ac11-4fdd06698f73', 'Grandma', 'Family means everything in this charming independent film. A teenager facing an unplanned pregnancy turns to her witty grandmother, a move that could heal old family wounds.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:39', '2017-03-07 16:33:39'),
(2972, '121bdd0c-0123-4ce2-ae26-e382b39f676a', 'The Interview', 'James Franco and Seth Rogen star in this crazy comedy. Tabloid journalists travel to North Korea to interview its leader, but are caught in the middle of an assassination plot.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:40', '2017-03-07 16:33:40'),
(2973, 'c50ae168-0fc7-4d41-9176-ab871cd08427', 'R.L. Stine\'s Mostly Ghostly: Have...', 'R.L. Stine\'s Mostly Ghostly: Have You Met My Ghoulfriend? Spooky kids\' film based on the popular book. A group of kids must save the world from an evil ghost and his ghouls.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:40', '2017-03-07 16:33:40'),
(2974, '53b043f8-5bda-4946-8158-8d3f16b4bf14', 'Chris Rock: Bigger &amp; Blacker', 'Actor and comedian Chris Rock makes audiences laugh until they cry with his stand-up comedy. Witty social commentary and political humour make for an unmissable special.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:40', '2017-03-07 16:33:40'),
(2975, 'acde53c7-9de8-4310-98e3-d0d3cbf8c0cf', 'It\'s Kind Of A Funny Story', 'From a teen\'s darkest hour comes a romcom about self-exploration. A teenager with clinically depression checks himself into a psychiatric ward and ironically finds a new hope.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:40', '2017-03-07 16:33:40'),
(2976, 'a5025540-6556-4ef0-85ca-f1001a9046e6', 'Adventures Of Tom Thumb And Thumbelina', 'Jennifer Love Hewitt and Elijah Wood star in this adorable animation. Two special, tiny people reunite 15 years after their village was destroyed by giants.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:40', '2017-03-07 16:33:40'),
(2977, '142a6f72-458e-4d24-a9d5-07d21721abaa', 'Accepted', 'Everyone wants to be accepted and in this epic college comedy, a high school student who just can\'t get into college creates a fake one to fool his parents.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:40', '2017-03-07 16:33:40'),
(2978, '353956ee-734d-4da1-9d0a-7adafd0b03e9', 'Jimmy Neutron: Boy Genius', 'Science and adventure meet in this kids\' animated film. A young genius and his friends set out to rescue their parents who were abducted by aliens.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:41', '2017-03-07 16:33:41'),
(2979, '201700c5-a7b9-464d-884a-97f67c53dfb2', 'The Swan Princess', 'An animated family comedy set in a land filled with magical powers. A princess meets her Prince Charming, but is turned into a swan by the town witch.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:41', '2017-03-07 16:33:41'),
(2980, 'fc2fa9b9-2257-45ea-b679-b2f6c10683be', 'Brewster\'s Millions', 'The late Richard Pryor\'s comedic genius is the driving force in this remake of a Hollywood. A man inherits $300 million but in order to get it he has to spend $30 million in 30 days.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:41', '2017-03-07 16:33:41'),
(2981, '035ae615-85a2-4a3d-a819-a5906e696d1a', 'Madagascar', 'Ben Stiller and a star-studded cast lend their voices to this great animation. Four zoo animals escape and unwittingly find themselves far away in the wilderness of Madagascar.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:41', '2017-03-07 16:33:41'),
(2982, 'f43b56fa-2097-4ac6-adfb-66bee0595e95', 'Shark Tale', 'An Oscar-nominated undersea adventure starring Will Smith. A small fish dreams of living the high life. Unfortunately, he tells a few lies to get what he wants.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:41', '2017-03-07 16:33:41'),
(2983, '3b94304e-0aa6-49eb-9957-9e7e75bb47c7', 'Gulliver\'s Travels', 'Travel writer Lemuel Gulliver takes an assignment in Bermuda, but ends up on the island of Liliput, where he towers over its tiny citizens.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:41', '2017-03-07 16:33:41'),
(2984, '5651592d-4cff-4c5a-bd8a-09c3f105a312', 'R.A.D.I.C.A.L.S', 'The kids will enjoy this adventure. Eight kids take their natural abilities to superhero levels and use them to fight a villain kidnapping neighbourhood dogs.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:41', '2017-03-07 16:33:41'),
(2985, '8c124638-744d-4be3-972a-3da1731462a8', 'The First Wives Club', 'Reunited by the death of a college friend, three divorced women seek revenge on the husbands who left them for younger women.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:41', '2017-03-07 16:33:41'),
(2986, '262cb962-eeba-4cd5-ab04-8845e3facb1b', 'Mystery, Alaska', 'The small town of Mystery, Alaska is home to many hockey-obsessed fans. They are thrilled when they are selected to play the New York Rangers for a publicity stunt.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:41', '2017-03-07 16:33:41'),
(2987, '5daffdca-d463-4180-a4b6-dab59f0b62c8', 'The Truth About Charlie', 'Thandie Newton stars in this stylish romantic thriller that blurs the line between good and bad. A criminal\'s death catapults his wife into a web of lies and intrigue.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:41', '2017-03-07 16:33:41'),
(2988, '1ac9125b-e9b4-465f-8e85-3b644656d451', 'Spy', 'Melissa McCarthy takes centre stage in this spy comedy. A desk-bound CIA analyst is flung into the deep end when she has to become a field agent in order to stop a global disaster.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:41', '2017-03-07 16:33:41'),
(2989, '37f778a1-c0ca-45e5-a1ba-fe4c6f3234b4', 'Above The Law', 'Action thriller featuring the martial arts expertise of Steven Seagal. This time, the action man must foil an elaborate assassination plot set up by the leader of a cartel.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:41', '2017-03-07 16:33:41'),
(2990, '25727dd2-efcc-4759-88fd-af7a0d87ad48', 'The Last Survivors', 'A film set in a frightening near future where water is a rare commodity. A young woman must fight to protect those close to her and the last of the water they have.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:41', '2017-03-07 16:33:41'),
(2991, 'e5ecd7b1-71b0-40d3-8741-7cd6eafa23e1', 'X2', 'Hugh Jackman and the team return for an action filled sequel. The X-Men fight a battle on two fronts. They must fight a mutant assassin and protect the academy from attack.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:41', '2017-03-07 16:33:41'),
(2992, '50846a33-de34-476d-8bf4-b77c2725dd04', 'Kidnapping Freddy Heineken', 'Sam Worthington (Avatar) and Oscar winner Anthony Hopkins star in a chilling crime thriller based on true events. A group of criminals kidnap a beer tycoon for a huge ransom.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:41', '2017-03-07 16:33:41'),
(2993, '8fe06e4f-f5b7-48cb-beba-d04b2ce2c69a', 'Along Came A Spider', 'Dramatic action thriller with Morgan Freeman as Alex Cross. When the kidnapper of a senator\'s daughter asks to deal with Cross personally, things take a dark turn.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:41', '2017-03-07 16:33:41'),
(2994, 'a516dfb3-46e3-4f82-b216-086d447cd3fd', 'X-Men', 'Bryan Singer brings a classic comic book franchise to life in this explosive action epic. A group of super powered mutants fight to save the world from evil forces.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:41', '2017-03-07 16:33:41'),
(2995, 'c27c1992-970a-43ac-99dd-8848fe251c47', 'National Treasure', 'In this fast-paced, action epic, Nicolas Cage is an adventurous historian racing against a team of mercenaries to discover a legendary treasure.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:42', '2017-03-07 16:33:42'),
(2996, '890780e3-ebb9-4ef8-9fe6-f74a23651eb8', 'Scorpion King 4: Quest For Power', 'This fantasy epic from the producers of \'The Mummy\' follows the legendary Scorpion King, who must outwit his enemies after being framed for an assassination.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:42', '2017-03-07 16:33:42'),
(2997, '5e1e4cd9-c6b3-4de5-a6cf-2f292550aac8', 'Southpaw', '\'Training Day\' director Antoine Fuqua and BAFTA winner Jake Gyllenhaal deliver a compelling drama about a broken boxer who systematically loses his wife, his way and then his daughter.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:42', '2017-03-07 16:33:42'),
(2998, 'b374c4f5-727b-46b3-829b-c94f2813dc5b', 'Bus 657', 'Robert De Niro is a man you don\'t want to cross in this intense action thriller. A father, desperate to save his sick daughter, forms a crew to steal from a ruthless casino owner.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:42', '2017-03-07 16:33:42'),
(2999, '8ac01f9c-0fab-4910-8e8b-8f7d82b4d4ad', 'Behind The Scenes: Song For Marion', 'A behind-the-scenes look at the movie \'Song For Marion\'.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:42', '2017-03-07 16:33:42'),
(3000, '56721ad1-6736-46c8-994e-a726f6f85539', 'The November Man', 'Pierce Brosnan stars in this cat-and-mouse action thriller. An ex-CIA operative is brought back to perform a very personal mission that sees him face off against his old pupil.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:42', '2017-03-07 16:33:42'),
(3001, '03f269d5-53fc-44f8-8b6f-8f393ab45269', 'Summer School', 'In this romantic comedy, a gym teacher is excited for the summer, but her plans are short lived. She is asked to assist at summer school, where she runs into some misfit students.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:42', '2017-03-07 16:33:42'),
(3002, '937ed035-38ff-484a-8fa8-4b7314d97e44', 'Maximum Risk', 'It\'s another JCVD classic as the action legend plays a policeman who takes his twin brother\'s place and inherits his problems with the FBI, the Russian mafia and his girlfriend.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:42', '2017-03-07 16:33:42'),
(3003, 'd3ce6438-f990-4247-a588-015c5d3aefbf', 'Adventureland', 'Jesse Eisenberg, Kristen Stewart and Ryan Reynolds star in this quirky comedy. A witty student is forced to take a summer job. He hates it at first but soon meets others like him.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:42', '2017-03-07 16:33:42'),
(3004, '2e6a4439-76f2-4628-a1ff-24fa1fb07ef4', 'Return To The Blue Lagoon', 'In this romantic drama, two teens find themselves stranded on an island in the South Pacific. With no guidance, they make a plan to survive and find themselves falling in love.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:42', '2017-03-07 16:33:42'),
(3005, '3d58f9ab-3f6d-48ed-9bc3-9ca6145c0c30', 'Lucky You', 'Love and gambling meet in this romantic drama starring Eric Bana and Drew Barrymore. A professional poker player begins to sacrifice his personal life for the game.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:42', '2017-03-07 16:33:42'),
(3006, 'b3c600a4-482e-4687-8655-df997b97ea43', 'She\'s Funny That Way', 'Owen Wilson and Imogen Poots lead a great cast in this film. A love triangle forms on the set of a playwright\'s project involving his wife, her ex and a call girl-turned-actress.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:42', '2017-03-07 16:33:42'),
(3007, 'dc207080-4ba6-44df-8033-c15a2cbfa9fe', 'Baby Mama', 'Tina Fey and Amy Poehler bring their unique humour to this comedy about a woman who hires an unlikely surrogate to have her baby, and must deal with the drama that follows.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:42', '2017-03-07 16:33:42'),
(3008, '6e8f7323-839c-49d9-b9a5-6d2d0974d9d2', 'Head Over Heels', 'Freddie Prinze Jr and Monica Potter star in this romcom of misunderstandings. A woman moves to New York and falls for a guy. Problem is she thinks she saw him kill a woman.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:42', '2017-03-07 16:33:42'),
(3009, '9fea3f22-e64d-4c8d-94e5-42ac72783cb0', 'X + Y', 'Asa Butterfield (Ender\'s Game) stars in this inspirational drama. A socially awkward teen prodigy finds confidence when he participates in the International Mathematical Olympiad.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:42', '2017-03-07 16:33:42'),
(3010, '7a5ab9a5-c385-4d78-908b-79e35d9a90b6', 'Independence Day', 'Will Smith stars in this blockbuster sci-fi. The world is under attack from an alien invasion. Driven purely by the will to survive the forces of Earth fight back.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:42', '2017-03-07 16:33:42'),
(3011, '155b6495-e708-47af-84c6-9e650c06c240', 'The Hot Chick', 'Funny man Rob Schneider is back in this hilarious take on the body-switching genre. This time he finds himself in the body of a mean-spirited teenage girl with a lesson to learn.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:42', '2017-03-07 16:33:42'),
(3012, '4cc34d9a-9d77-42cd-9f23-2d343f8b954d', 'Hitman: Agent 47', 'Rupert Friend (Homeland) stars in this action-packed film based on the popular video game. An assassin helps a woman find her father and solve her mysterious ancestry.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:42', '2017-03-07 16:33:42'),
(3013, '504d5b39-5c6f-4d6d-a9ec-906c79dc07a5', 'Revolutionary Road', 'Leonardo DiCaprio and Oscar winner Kate Winslet star in this period drama. A troubled young couple fights to keep their marriage alive while trying to raise their kids.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:42', '2017-03-07 16:33:42'),
(3014, '469e379d-c916-4f22-8887-2c411d4f3d35', 'Death Warrant', 'Action legend Jean-Claude Van Damme takes on a corrupt prison system in this film. A cop risks his life as he goes undercover to investigate a string of murders.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:43', '2017-03-07 16:33:43'),
(3015, '3fdd6a10-92a4-4a67-9635-e197029432f9', 'Black Rain', 'Michael Douglas and Andy Garcia take on the Yakuza in this crime thriller. Two cops travel to Japan as they hunt down a cold blooded killer.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:43', '2017-03-07 16:33:43'),
(3016, '489bddbb-310c-41c1-8bd5-aae4575ac373', 'Three Fugitives', 'Nick Nolte and Martin Short make up two of three fugitives in this crazy comedy. A man recently released from prison accidentally becomes part of another man\'s armed robbery.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:43', '2017-03-07 16:33:43'),
(3017, 'ff8ddbd5-6ec3-4d18-84ea-0e71a02099aa', 'Penthouse North', 'Oscar nominee Michael Keaton is the bad guy in this intriguing drama about a blind woman whose penthouse comes under attack by a man looking for a stash of stolen diamonds.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:33:43', '2017-03-07 16:33:43'),
