(3806, '5961c788-853a-4b6e-bc2c-25c815fa9c3c', 'Koekedoor', '\'S2/E21\'. Die deelnemers moet in een van die uitdagings \'n pretzel maak. Tiaan verwag dat elkeen \'n craftbier trek en die pretzel se smaakprofiel aanpas by die bier se mees prominente geure.', NULL, NULL, NULL, NULL, '2', '21', '2017-03-07 16:34:28', '2017-03-07 16:34:28'),
(3807, 'cb16d598-086a-407b-97a8-36544308c237', 'Binnelanders', '\'S5/E1287\'. Die spanning loop hoog tussen Annelize en Bronwyn. Pippa wik en weeg om die strydbyl te begrawe en Rossouw kry \'n aanbod wat hy nie kan weier nie. Dis tyd vir iemand om te groet by Binneland Kliniek.', NULL, NULL, NULL, NULL, '5', '1287', '2017-03-07 16:34:28', '2017-03-07 16:34:28'),
(3808, '6a3534cf-46d1-4077-b84f-c175fcbc3cf4', 'Villa Rosa', '\'S11/E2269\'. Stef wonder oor die foto van Liam en die rede hoekom hy dit ontvang het. Carina maak dit duidelik dat sy niemand in haar lewe nodig het nie en Fritz kan maar net nie die regte ding sê of doen wat die troureëlings betref nie.', NULL, NULL, NULL, NULL, '11', '2269', '2017-03-07 16:34:28', '2017-03-07 16:34:28'),
(3809, 'ea03ecb6-0176-49fc-8861-6f4aafb871c9', 'Suidooster', '\'S2/E241\'. Ian kom nader aan die waarheid oor Ismail en Bridgette se verhouding. Mrs J probeer Lee-Ann oortuig om beheer van die sentrum te laat gaan. Jerome en Nicole vind uit hulle gaan aandele kry.', NULL, NULL, NULL, NULL, '2', '241', '2017-03-07 16:34:28', '2017-03-07 16:34:28'),
(3810, '5b154c2e-df20-444d-9dbe-873b23c88fbe', 'kykNET Aktueel - Winslyn', '\'S3/E114\'. \'n Informatiewe program, aangebied deur Divan Botha, wat aktuele kwessies in die sakewêreld aanroer. Winslyn fokus op entrepreneurs, ondernemings en tegnologie. Facebook: WinslynTV.', NULL, NULL, NULL, NULL, '3', '114', '2017-03-07 16:34:28', '2017-03-07 16:34:28'),
(3811, 'e7a87401-6296-49ac-928d-3be46ddf127b', 'Vlug Na Egipte', '\'S1/E2 - 1/2\'. Breggie en Abdoel kry stry oor Cyril, en Giel se handewerk noodsaak Ds Karl om \'n draai te gaan maak op Daggafontein. Kortjas stel sy bure bekend aan Priscilla, terwyl Dot en Tony konkel oor Troffel se wildsvleis.', NULL, NULL, NULL, NULL, '1', '2', '2017-03-07 16:34:28', '2017-03-07 16:34:28'),
(3812, '99b0d370-ebd4-4ef5-b86a-a87ed0aaa1ef', 'VeranderDinge', '\'S3/E9\'. Ons gesels met modeontwerper Gert-Johan Coetzee en kry raad oor hoe om sonder alkohol sosiaal te verkeer. Daarna ontmoet ons \'n graffiti kunstenaar wat wêreldwyd mure betower.', NULL, NULL, NULL, NULL, '3', '9', '2017-03-07 16:34:28', '2017-03-07 16:34:28'),
(3813, '8002327f-48fc-42b0-a92d-6b0a8633b18d', 'Heidi', '\'S1/E45\'. Heidi is \'n weeskind wat by haar oupa moet gaan bly in die Alpe. Die norse oupa word klei in Heidi se hande, ons leer ook vir Peter en die kwaai Juffrou Rottenmaier ken.', NULL, NULL, NULL, NULL, '1', '45', '2017-03-07 16:34:28', '2017-03-07 16:34:28'),
