(3816, 'ff4c329f-04c2-45c1-9254-ad446200ebc5', 'Jou Show', '\'S7/E132\'. Dozi kuier in die ateljee en laat ons huil van die lag, Tinarie van Wyk-Loots vertel van \'n paar gruwelike B-graad rolprentervarings wat sy gehad het. PG Engelbrecht betower ons met sy kulkuns.', NULL, NULL, NULL, NULL, '7', '132', '2017-03-07 16:34:28', '2017-03-07 16:34:28'),
