(4628, 'f73641ca-efb7-4698-b774-8c583954aba6', 'Thuis', 'Episode #17.132 - Franky wants to know if Tibo has an affair with Ellen. Tibo finally explains he met Ellen when he was 17. She\'s a lesbian and they got along very well at the time. Franky still thinks it\'s ...', 'N/A', 'episode', 'tt2255497', 0, '17', '132', '2017-03-07 16:35:10', '2017-03-07 16:41:17'),
