(4634, 'b038e8b0-ebda-4dec-8999-4c28fc8580ce', 'Droomhuis Gezocht!', '\'S1/E3 - 1/3\'. Sybrand Niessen helpt Nederlanders bij het vinden van hun droomhuis in het buitenland. In elke aflevering staat een land centraal. De zoektocht leidt ons naar Oostenrijk, Italië en Bonaire.', NULL, NULL, NULL, NULL, '1', '3', '2017-03-07 16:35:10', '2017-03-07 16:35:10'),
(4635, 'cdc704a3-64bd-470a-86be-26d20ea5f4c7', 'Het Instituut', '\'S1/E3 - Humor\'. Wat gebeurt er als je een kazerne ombouwt tot wetenschappelijk instituut en er honderd mensen in opsluit met Joep van Deudekom en Rob Urgert? Sophie Hilbrand helpt.', NULL, NULL, NULL, NULL, '1', '3', '2017-03-07 16:35:10', '2017-03-07 16:35:10'),
(4636, '84b2bbb5-1bc5-4b9f-90ba-c0d799fce1f4', 'Per Seconde Wijzer', '\'S51/E6 - 51/6\'. Twee spelers beantwoorden binnen 200 seconden vier vragen. Hoe zullen zij hun jokers inzetten, hoeveel rondes zullen de spelers het volhouden? En met welk bedrag gaan de spelers uiteindelijk naar huis?', NULL, NULL, NULL, NULL, '51', '6', '2017-03-07 16:35:10', '2017-03-07 16:35:10'),
