(4640, '71f2c513-752c-4dd0-805b-0e8343f6292d', 'Van Gils &amp; Gasten', '\'S1/E30 - 1/30\'. Talkshow waarin gastheer Lieven Van Gils met zijn gasten praat over alles wat er in Vlaanderen en de wereld leeft.', NULL, NULL, NULL, NULL, '1', '30', '2017-03-07 16:35:10', '2017-03-07 16:35:10'),
