(4642, '087909c6-e82d-4475-831a-bcae35c7bb9e', 'Nederland Verhuist', '\'S1/E10 - 1/10\'. Verhuizen staat in de stress top drie. Toch doen we het massaal. Dit jaar verhuizen meer dan 1,5 miljoen mensen. In \'Nederland Verhuist\' volgen we twee verhuizingen.', NULL, NULL, NULL, NULL, '1', '10', '2017-03-07 16:35:10', '2017-03-07 16:35:10'),
(4643, 'f1c85103-0d5e-42bb-8ad3-813bdb23bc3a', 'The Homeless Experience', '\'S17/E2 - 17/2\'. Acteur Dragan Bakema verlaat huis en haard om, tussen de zwervers, op straat te leven. Een bikkelharde confrontatie met de straat, maar bovenal met zichzelf.', NULL, NULL, NULL, NULL, '17', '2', '2017-03-07 16:35:11', '2017-03-07 16:35:11'),
(4644, 'f79ef9a8-1673-4cf3-a64b-42b11df8111c', 'MAX Geheugentrainer', '\'S1/E48 - 1/48\'. Met MAX Geheugentrainer kunnen kijkers elke werkdag hun geheugen trainen door mee te spelen met de kandidaat in de studio. De presentatie van het programma is in handen van MAX-directeur Jan Slagter.', NULL, NULL, NULL, NULL, '1', '48', '2017-03-07 16:35:11', '2017-03-07 16:35:11'),
(4645, '6916bc31-0794-464e-a74f-5e407841c171', 'Sesamstraat', '\'S1 - Alleen\'. Pino wil niet alleen spelen op zijn kamer. Dat is zo saai!', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:11', '2017-03-07 16:35:11'),
