(4650, '2e534b8d-bff7-4520-99b2-d3c86050409a', 'Goed Gezien!', '\'S1/E3 - 1/3\'. De Ketnet-wrappers Sien Wynants en Leonard Muylle reizen de wereld rond, op zoek naar slimme uitvindingen voor problemen in ontwikkelingslanden. De kinderen helpen mee.', NULL, NULL, NULL, NULL, '1', '3', '2017-03-07 16:35:11', '2017-03-07 16:35:11'),
