(4655, '077631ab-42d3-40e4-a243-44480497b1fb', 'Keuringsdienst Van Waarde', '\'S17/E8 - 17/8\'. In dit bizarre spelprogramma strijden vier beste vrienden tegen elkaar. Presentator Sascha Visser onderwerpt hen aan de meest idiote, spannende en smerige opdrachten. De verliezer verliest z\'n haar.', NULL, NULL, NULL, NULL, '17', '8', '2017-03-07 16:35:11', '2017-03-07 16:35:11'),
(4656, 'ded65aea-7be0-46a9-9bd7-fa53cacb67a0', 'DNA Onbekend', '\'S1/E1 - 1/1\'. Is mijn vader wel mijn echte vader? Zijn mijn broers en zussen wel mijn echte familie? Caroline Tensen helpt mensen om voor eens en altijd duidelijkheid te scheppen.', NULL, NULL, NULL, NULL, '1', '1', '2017-03-07 16:35:11', '2017-03-07 16:35:11'),
(4657, 'd3a9400e-1efd-463f-8ce4-53005f0d83ea', 'Le Journal De La RTBF', 'Toute l\'actualité internationale proposée et présentée par la rédaction de la RTBF.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:11', '2017-03-07 16:35:11'),
(4658, 'a44032b0-439f-41ba-a062-d58b0b14fabe', 'De Klas', '\'S1/E2 - 1/2\'. In \'De klas\' ziet een inspirerende leerkracht hoe jongeren leven en denken. Elke week staat een andere bekende Vlaming voor de klas, die hun dromen en zorgen peilt.', NULL, NULL, NULL, NULL, '1', '2', '2017-03-07 16:35:11', '2017-03-07 16:35:11'),
(4659, 'c3893212-3363-4a86-ad14-1359555e9f3c', 'Questions À La Une', '\'S1 - Qui Sont Les Multimillionnaires Belges ?\'. La Belgique n\'a jamais compté autant de millionnaires et de milliardaires! Qui sont-ils? Comment dépensent-ils leur argent? Frédéric Deborsu part à la rencontre des grosses fortunes belges.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:11', '2017-03-07 16:35:11'),
(4660, 'e6e76c3d-b441-4e7a-8b29-e37fa754e029', 'TV5MONDE Le Journal', 'Toute l\'actualité nationale et internationale proposée par la rédaction de TV5MONDE.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:11', '2017-03-07 16:35:11'),
(4661, '18d452bd-d993-44a4-b29f-1f1c16d5a13e', 'Les Petits Meurtres D\'Agatha Christie', '\'S1\'. Trois meurtres sont commis dans un centre de réinsertion dirigé par Rose-Marie Bousquet, riche héritière très amoureuse de son mari Étienne. Le commissaire Laurence entre en scène.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:11', '2017-03-07 16:35:11'),
(4662, '03ed7758-4fd8-4fad-802c-ee44153572d0', 'Jardins Et Loisirs', '\'S1 - Ambiance Méditerranéenne En Val De Loire\'. La douceur angevine est propice au développement d\'une large gamme de plantes. Direction les bords de Loire, dans un jardin qui a le pouvoir de vous transporter au sud de la France.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:12', '2017-03-07 16:35:12'),
(4663, '236415be-0e83-4dea-ac0a-1a3da1b38105', 'C\'Est Du Belge', '\'S1 - Pierre Kroll\'. Cette semaine, Gerald Watelet offre carte blanche au dessinateur et caricaturiste belge Pierre Kroll. Au sommaire également: l\'Ancienne Belgique qui fête ses 35 ans et une séquence coup de coeur de Marie-Hélène.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:12', '2017-03-07 16:35:12'),
(4664, '40c3cd4c-1bcd-4ffb-9b71-d2aacff2f072', 'On N\'Est Pas Que Des Cobayes', '\'S1 - Fabriquer Un Pendule De Newton Géant\'. Quels sont les secrets du pendule de Newton? Agathe en aimerait un géant! Comment deux boules d\'acier arrivent à rebondir l\'une contre l\'autre?', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:12', '2017-03-07 16:35:12'),
(4665, '2e9c2acc-5fa5-4f0c-be0e-6c269cd8f6f9', 'Thuis', '\'S17/E133 - 17/133\'. Vlaamse soapserie met elke keer een vertrouwde maar altijd nieuwe mix van drama, romantiek, spanning en humor over turbulente avonturen en relaties.', NULL, NULL, NULL, NULL, '17', '133', '2017-03-07 16:35:12', '2017-03-07 16:35:12'),
(4666, '0c8d7b55-6f94-4f4f-a948-daa468a69243', 'Temps Présent', '\'S1 - Trafic De Travailleurs, L\'eldorado Suisse\'. Du dumping salarial qui relève de l\'usure, des faux frontaliers avec de vrais permis, certains employeurs ne reculent devant rien, pas même devant des méthodes utilisées par la mafia.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:12', '2017-03-07 16:35:12'),
(4667, '8a54cde4-9dce-4cb0-8eec-d38df56d1ed2', 'TV5MONDE Le Journal', 'Toute l\'actualité nationale et internationale proposée par la rédaction de TV5MONDE.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:12', '2017-03-07 16:35:12');
