(4675, '7bfd47fe-a19a-4b57-b392-d5a63a77c1dd', 'Waga Love', '\'S1 - Vivre Ensemble\'. Les services de l\'agence se développent avec l\'ouverture d\'une section consacrée au conseil matrimonial. Sandra reçoit les premiers couples venus exposer les difficultés qu\'ils rencontrent.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:13', '2017-03-07 16:35:13'),
