(4677, 'b1a470ca-273a-4c86-9188-be9cee36327d', 'Tout Le Monde Veut Prendre Sa Place', '\'S1\'. Le jeu où tout le monde peut devenir champion. Un quiz, six candidats et, bien calé dans son fauteuil, un champion que tous rêvent de déloger! Présenté par Nagui.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:13', '2017-03-07 16:35:13'),
(4678, '7e8a3581-4355-4a4f-86c1-5c5562bf8bff', 'Les Bobodiouf Le Retour', '\'S1 - Qui Veut Du Bon Pâté ?\'. Souké et Siriki croient avoir flairé la bonne affaire! Ils montent une arnaque avec des boîtes de conserves. Parviendront-ils cette fois-ci à faire fortune?', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:13', '2017-03-07 16:35:13'),
(4679, 'ec361e5a-d6bd-40c0-8dc9-f05bdf089268', 'Plus Belle La Vie', 'Chroniques de la vie quotidienne au Mistral, quartier populaire de Marseille, avec ses joies, ses drames, ses histoires d\'amour et de haine, ses secrets.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:13', '2017-03-07 16:35:13'),
(4680, 'ce43b450-5a22-43bf-b6ac-fdd6cb3bd691', 'S\'Il N\'En Restait Qu\'Une', '\'S15 - Pierre Gagnaire\'. Pierre Gagnaire, alternant cuisine et confessions, fait partager l\'un de ses plats emblématiques: des huîtres servies avec des cerises, des anchois et des petits pois.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:13', '2017-03-07 16:35:13'),
(4681, '7f4ed15a-f412-47d1-9eda-e21b319e199e', 'TV5MONDE Le Journal', 'Toute l\'actualité nationale et internationale proposée par la rédaction de TV5MONDE.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:13', '2017-03-07 16:35:13'),
(4682, 'c32b08c4-55d8-4fbe-858b-61685da41040', 'Brèves De Taxi', '\'S1 - Les Parents\'. La bienveillance des parents détermine-t-telle la destinée? Qui seraient-ils devenus sans l\'absence d\'un père ou la perte d\'une maman?', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:13', '2017-03-07 16:35:13'),
(4683, '01d4fd77-ee6e-4573-a317-af12a0590797', 'Et Si... Vous Me Disiez Toute...', '\'S1\'. Et Si... Vous Me Disiez Toute La Vérité. Invité : Guy Nzouba-Ndama, ancien président de l\'Assemblée nationale du Gabon et candidat à l\'élection présidentielle du 28 août 2016.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:13', '2017-03-07 16:35:13'),
