(4829, 'e4168e34-15ea-432a-8b7c-e6345a32094f', 'The Vampire Diaries', 'Nostalgia\'s a Bitch - Sybill puts Damon in a catatonic state for revenge. Caroline and Bonnie enter Damon\'s mind and realize Stefan is the key to his fate. Sybill competes with his sister for control of the bell.', 'https://images-na.ssl-images-amazon.com/images/M/MV5BN2FjNjBlMDEtNGMxNS00MmU2LThkYTAtOGNkOTBiMjZjZjA1XkEyXkFqcGdeQXVyNjM2MzAyODA@._V1_SX300.jpg', 'episode', 'tt5668522', 0, '8', '10', '2017-03-07 16:35:21', '2017-03-07 16:41:22'),
