(4831, 'af6d50b6-efdb-4640-9442-0b2ec80dd183', 'Love And Hip Hop', '\'S6/E10 - Showcase Showdown\'. Gwinin Fest XL brings all of the young female MCs together to battle for the top spot, but things get personal when Mariah Lynn exposes Moe\'s skeletons.', NULL, NULL, NULL, NULL, '6', '10', '2017-03-07 16:35:21', '2017-03-07 16:35:21'),
