(4833, '694cc02f-d70a-4672-b115-6c510d407a67', 'Burnt', 'Bradley Cooper pours his heart into this performance, bringing this film to life. A formerly successful chef battles his demons of addiction in order to reach the top again.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:21', '2017-03-07 16:35:21'),
(4834, 'a1bf4890-a071-447e-8c35-a22de0fe3b03', 'The Other Side Of The Door', 'Tragedy turns to terror in this movie when a mother tampers with unknown forces. After an accident, she tries to contact her dead son, but brings back a dark evil instead.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:21', '2017-03-07 16:35:21'),
(4835, 'aef491ce-1382-4be6-99f4-2675a30d7cc8', 'Little Savages', 'This entertaining family film sees two siblings race against a group of bullies in order to find an awesome hidden treasure.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:21', '2017-03-07 16:35:21'),
(4836, 'd7b95606-1b7f-4dee-a4e4-845fb9c0bdaa', 'The Benefactor', 'Richard Gere\'s a man filled with guilt and hidden motives in this drama. After losing his family in an accident, he tries to help a young couple, but what does he want in return?', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:21', '2017-03-07 16:35:21'),
(4837, '4ca3e71a-3548-49b7-b2be-936c8fb2def5', 'Jesse Stone: Lost In Paradise', 'Tom Selleck (Magnum, P.I.) returns for another action packed adventure in this crime franchise. The Police Chief of a small town investigates the work of a serial killer.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:22', '2017-03-07 16:35:22'),
(4838, '67f0214c-2072-4e9e-8bf2-f53fba13d1b4', 'Waffle Street', 'A riches-to-rags tale based on the memoirs of a failed financier\'s foray into the food industry. See how a man builds himself up from what he thought was his darkest time.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:22', '2017-03-07 16:35:22'),
(4839, 'c37c1f88-f29e-4233-98a1-d3c1643cf932', 'The Little Prince', 'An enchanting animation for the whole family. A young girl who lives a very strict life meets an old man who introduces her to an extraordinary new world of dreams and wonder.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:22', '2017-03-07 16:35:22'),
(4840, '5dcd2eab-bc33-4631-a1bf-9e75a14ba1dd', 'A.R.C.H.I.E.', 'Michael J Fox lends his voice talent to this entertaining canine adventure. A talking robot dog befriends a group of teenagers and tries to help them save their small town.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:22', '2017-03-07 16:35:22'),
(4841, '9ece1f1f-59fb-4fb8-81fd-023eb0391c98', 'Miracles From Heaven', 'Jennifer Garner goes on a journey of faith in this film based on an incredible true story. A family\'s tested when a girl is diagnosed with a rare disorder. But a miracle occurs.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:22', '2017-03-07 16:35:22'),
(4842, 'aa924768-3481-4f72-bffa-c1fc126722eb', 'Sleeping With Other People', 'People find love in the strangest places. This out of the ordinary romcom sees a womaniser and a serial cheater form a plutonic relationship, but will it become something more?', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:22', '2017-03-07 16:35:22'),
(4843, '178417f1-7e4a-4551-97d9-83aee3dc4479', 'We Are Your Friends', 'Zac Efron enters the very murky and addictive world of DJs. An aspiring DJ has to navigate through the temptations of the industry as he looks for fame and fortune.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:22', '2017-03-07 16:35:22'),
(4844, '8559e055-538f-41ba-8392-774c95b00c45', 'Avatar', 'Acclaimed director James Cameron creates a visually stunning sci-fi adventure. A global cooperation goes to war with a planet\'s indigenous people over their very rare minerals.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:23', '2017-03-07 16:35:23'),
(4845, '5a942641-50ab-4a65-a70d-00291e5f0702', 'The Huntsman: Winter\'s War', 'Evil returns in this visually stunning sequel to the edgy adaptation of Snow White. Chris Hemsworth battles two sinister sisters: Charlize Theron and Emily Blunt.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:23', '2017-03-07 16:35:23'),
(4846, 'c7ac6175-4a8d-41ab-9fce-2d43c8b46d1f', 'My Big Fat Greek Wedding 2', 'In this sequel to the 2002 hit \'My Big Fat Greek Wedding\' the revelation of a family secret and an even bigger, fatter wedding brings the Portokalos family together again.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:23', '2017-03-07 16:35:23'),
(4847, 'dc2f72bf-6df5-4154-8567-36a70da820f0', 'Happiness Is A Four-Letter Word', 'Based on the M-Net Literary Award-winning novel, this charming rom-com follows three girlfriends trying to find success, love and happiness in a complicated world.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:23', '2017-03-07 16:35:23'),
(4848, '51e4316b-53ef-410d-92b4-7b7425d1cc08', 'Adult World', 'Trying to overcome failure to follow a dream is the theme of this film. An unemployed, former university student and aspiring poet is trying to make it in the adult world.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:23', '2017-03-07 16:35:23'),
(4849, 'be2ee282-a2ac-439f-aac4-abbd7a7e2498', 'A Simple Wish', 'In this unconventional comedy, Murray (Martin Short) is a male fairy godmother trying to help young Anabel fulfil her wish for her father to win the leading role in a Broadway musical.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:23', '2017-03-07 16:35:23'),
(4850, 'e3f8e027-59da-4169-b7e1-a939964cfd69', 'Casper', 'This kids\' film shows that not all ghosts are bad. A paranormal expert and his daughter move into an abandoned house that happens to be haunted.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:23', '2017-03-07 16:35:23'),
(4851, '4fe3cb14-62af-4e3f-95a4-e6f10a587921', 'Little Rascals', 'The little rascals have comical misadventures when the boys form a club that excludes girls. But the president of the club has fallen for a pretty nine-year-old girl.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:23', '2017-03-07 16:35:23'),
(4852, '1793856a-1ac3-4f7f-805a-e3e6ae7fef44', 'Postman Pat: The Movie', 'The world\'s most popular postman returns for another adventure and this time his beliefs are put to the test when he enters a TV talent show contest.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:23', '2017-03-07 16:35:23'),
(4853, '080b4cc5-6c98-42bb-93f6-43a0bd4fbcce', 'American Girl: Isabelle Dances Into...', 'American Girl: Isabelle Dances Into The Spotlight. If you\'re a fan of dance movies, this fun teen flick is for you. A young girl has a dream to be a dancer, but she must fight her fears.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:23', '2017-03-07 16:35:23'),
(4854, '46cfa381-75c1-43c4-8b8b-5819e034ebd5', 'Maya The Bee Movie', 'This fun-filled family animation follows a courageous bee as she goes on an adventure to save her hive from an army of hornets.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:23', '2017-03-07 16:35:23'),
(4855, '8e13a551-b4db-48bb-a61a-287478dc59e4', 'Horse Camp', 'The power of friendship takes centre stage in this warm-hearted family movie. When a teen girl heads for horse camp, she must deal with the resident mean girl.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:23', '2017-03-07 16:35:23'),
(4856, '432441cf-2bad-490f-814c-e36ac706db35', 'Black Or White', 'Kevin Costner stars in this touching drama. A grieving widower, who has helped raise his grandchild her whole life, is stuck in a custody battle with her estranged family.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:23', '2017-03-07 16:35:23'),
(4857, '705f674b-1506-42e0-935f-0fbff3e582f3', 'Jenny\'s Wedding', 'Katherine Heigl challenges the values of her conservative family in this charming, heartfelt dramedy about a woman who comes out to her family when she decides to get married.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:23', '2017-03-07 16:35:23'),
(4858, '6d1dbe31-d074-4d67-a901-3dfc8dcc7af9', 'Madagascar: Escape 2 Africa', 'A group of animals is stranded on Madagascar, so they fix up an old plane to fly back to America. However, the plane lands in Africa instead.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:23', '2017-03-07 16:35:23'),
(4859, 'd2b0791f-96cd-4155-8593-8104b41f8f4e', 'The Best Man', 'Friendships are tested in this romcom staring Taye Diggs. A man\'s autobiographical, \'tell all\' book exposes his friends\' secrets, putting his friend\'s wedding in jeopardy.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:23', '2017-03-07 16:35:23'),
(4860, 'd9f3cc5e-139f-458c-85f9-5a0835d52f62', 'Mistress America', 'Noah Baumbach writes and directs this off-the-wall comedy. A young woman\'s life is turned upside down when she embarks on a New York adventure with her future sister-in-law.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:24', '2017-03-07 16:35:24'),
(4861, '9e9f9a8d-ddfc-407a-a12e-f3ccea5da4e9', 'Dark Places', 'Oscar winner Charlize Theron gives a gripping performance in this thriller. Thirty years after her mother\'s murder, a woman returns to her home town to uncover the truth.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:24', '2017-03-07 16:35:24'),
(4862, 'b8f8a3f0-d687-46b7-ad92-a7a913d07604', 'The Night Crew', 'Danny Trejo delivers a villainous performance in this action film. A group of bounty hunters fight for their lives as they protect a fugitive in their custody from a notorious gang.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:24', '2017-03-07 16:35:24'),
(4863, '0e1c4492-f7b1-4b89-a956-36340debf283', 'The Saint', 'Val Kilmer stars in this remake of the 1960s hit crime franchise. A master thief is hired by the Russian Mafia to steal a cold-fusion energy formula, but this goes horribly wrong.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:24', '2017-03-07 16:35:24'),
(4864, 'bf848cb2-7583-4305-bfae-395e04172bcb', 'Turbulence', 'There\'s no escape at 30 000 feet in the air. In this thriller a serial killer threatens to crash an airliner. It is up to a flight attendant to save everyone on board.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:24', '2017-03-07 16:35:24'),
(4865, 'ab35358c-fa7d-4f2a-9f6e-f01b9471a8d1', 'Vertical Limit', 'A crew of ace climbers sets out on a daring mountain rescue mission, which gets complicated by one of the rescuers\' sister being in the trapped party.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:24', '2017-03-07 16:35:24'),
(4866, 'ab4d689d-47ed-4f19-b329-d765d30773c7', 'Blue Streak', 'Martin Lawrence stars in this crime comedy. An ex-con pretends to be a cop in order to retrieve a diamond he stashed in a police station, but gets caught up in something bigger.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:35:24', '2017-03-07 16:35:24'),
