(5525, '96aed687-ddfb-4a84-aab3-1f5b41af0289', 'Cake Boss', 'Cakes on a Plane - A Carlo\'s creation goes higher than ever before when a team of skydivers decides to take a cake with them during a jump-- and eat it as they fall. Then Buddy makes a cake for his niece ...', 'http://ia.media-imdb.com/images/M/MV5BMjA4NjA1NTc0Ml5BMl5BanBnXkFtZTgwNDcwMjEzMjE@._V1_SX300.jpg', 'episode', 'tt2261740', 0, '5', '15', '2017-03-07 16:36:00', '2017-03-07 16:41:51'),
(5526, '330a8fd7-a92e-48a8-9829-4136765fd95a', 'Cake Boss', 'Under the Sea - Happy Sweet 16! Grace throws an Under the Sea Themed party for her daughter Bartolina\'s Sweet 16 and Uncle Buddy has the perfect cake in mind -- a real aquarium, surrounded with a colorful cake reef and edible sharks circling overhead.', 'http://ia.media-imdb.com/images/M/MV5BMzc1MjMwOTg1N15BMl5BanBnXkFtZTgwNzUwMzIzMjE@._V1_SX300.jpg', 'episode', 'tt2248238', 0, '5', '16', '2017-03-07 16:36:00', '2017-03-07 16:41:51'),
(5527, 'd5ef545b-5133-4c32-95e7-ad6d0b404bc5', 'Cake Boss', '\'S5/E17 - Cut The Ribbon And The Cake\'. Buddy and his team create a special cake for a new children\'s hospital in Chicago. Plus, a couple wants a wedding cake that matches their grey invitations - but Buddy hates grey.', NULL, NULL, NULL, NULL, '5', '17', '2017-03-07 16:36:00', '2017-03-07 16:36:00'),
(5528, '8b29e3e3-a7c7-4d04-af9c-fc7267c7e465', 'Cake Boss', 'A Golden Opportunity - Buddy is given 24-hrs to create a cake for legendary actress and comedienne Betty White. This \"golden\" opportunity turns serious when Buddy reveals the cake has to be a life-size replica of...', 'http://ia.media-imdb.com/images/M/MV5BODY4ODE5NTcxOF5BMl5BanBnXkFtZTgwODc4OTEzMjE@._V1_SX300.jpg', 'episode', 'tt2516076', 0, '5', '18', '2017-03-07 16:36:00', '2017-03-07 16:41:51'),
(5529, '2248416c-f917-47ff-81eb-f2469433d8ee', 'Cake Boss', '\'S5/E20 - Operation Tank Cake\'. To celebrate the anniversary of the US Army, Buddy is creating two special cakes. One must wow an audience of troops in Times Square and the other will travel to Afghanistan.', NULL, NULL, NULL, NULL, '5', '20', '2017-03-07 16:36:01', '2017-03-07 16:36:01'),
(5530, '3d678d78-c1a3-4f52-8775-b39a1c39fdee', 'Cake Boss', 'Players, Lawyers, and Pranksters - The Carlo\'s Bakery team rallies around their head coach Buddy as they build a special cake for NY Giant\'s Coach Tom Coughlin\'s charity foundation. Then, Marissa decides it\'s prank payback time for the boys.', 'http://ia.media-imdb.com/images/M/MV5BMTc3NTA5NDA0NF5BMl5BanBnXkFtZTcwODg1NTk5Mw@@._V1_SX300.jpg', 'episode', 'tt2593932', 0, '5', '19', '2017-03-07 16:36:01', '2017-03-07 16:41:51'),
