(5532, 'e3473729-5469-426b-8edc-b2669ec79ffc', 'Cake Boss', 'Hocus Pocus - Buddy must conjure up a magic-themed cake for shock illusionist Dan Sperry, who challenges Buddy to make a cake with no instructions, only a prediction to be locked unopened inside the cake. At delivery, will the prediction come true?', 'http://ia.media-imdb.com/images/M/MV5BMjExMzc1OTgwM15BMl5BanBnXkFtZTgwMzIyMzIzMjE@._V1_SX300.jpg', 'episode', 'tt2542722', 0, '5', '21', '2017-03-07 16:36:01', '2017-03-07 16:41:51'),
