(5673, '5f47e8b3-6816-494b-aa43-a4c6e39fe10b', 'Oupa En Ouma', '\'S1/E9 - 1/9\'. Stanley kla by Patience oor sy ouderdom. Debora probeer haar innerlike kind vind en Stanley wil \'n motorfiets koop. Stanley se vergeetagtigheid ry so byna Anna se aandete in die wiele.', NULL, NULL, NULL, NULL, '1', '9', '2017-03-07 16:36:07', '2017-03-07 16:36:07'),
(5674, '82b7c0f0-074d-4dbc-b433-6ed7217a2848', 'VeranderDinge', '\'S3/E9\'. Ons gesels met modeontwerper Gert-Johan Coetzee en kry raad oor hoe om sonder alkohol sosiaal te verkeer. Daarna ontmoet ons \'n graffiti kunstenaar wat wêreldwyd mure betower.', NULL, NULL, NULL, NULL, '3', '9', '2017-03-07 16:36:07', '2017-03-07 16:36:07'),
(5675, 'c5cda1ea-03a3-415f-a7a3-ada3a946ca60', 'Glam Guru', '\'S11/E9\'. Chantelle is \'n enkelouer en al drie jaar enkellopend. Om \'n potensiële lewensmaat te ontmoet moet jy eerstens raakgesien word en daarom het sy Glam Guru se hulp ingeroep.', NULL, NULL, NULL, NULL, '11', '9', '2017-03-07 16:36:07', '2017-03-07 16:36:07'),
(5676, '5d845327-3b3a-4c62-b3cc-e6ef0e4065de', 'Kruispad', '\'S1/E8 - 1/8\'. 2001. F.G. lewer \'n positiewe bydrae tot die groei van Henk en Jason se besigheid, maar Jason bly skepties. Sophia sukkel om aan te pas by \'n lewe van armoede.', NULL, NULL, NULL, NULL, '1', '8', '2017-03-07 16:36:08', '2017-03-07 16:36:08'),
(5677, 'c7f4048a-7603-47d8-9d77-bdbb7765cdbe', 'Die Silwerskermfees Kortflieks', '\'S4/E10 - Foto\'. \'n Jong fotograaf is gefassineerd deur die treffende foto\'s van \'n anonieme foto-uitstalling en begin \'n soektog na die fotograaf. Hoe meer leidrade sy vind, hoe dieper word sy vasgevang in die fotograaf se donker geheim.', NULL, NULL, NULL, NULL, '4', '10', '2017-03-07 16:36:08', '2017-03-07 16:36:08'),
