(5680, '8e5aafab-fec2-487e-bc43-092c52877627', 'Grootplaas', '\'S2/E83\'. Maak jouself vroeg-vroeg voor die kassie tuis, vir die jongste landbounuus, landboumarkte asook interessante tegniese gesprekke.', NULL, NULL, NULL, NULL, '2', '83', '2017-03-07 16:36:08', '2017-03-07 16:36:08'),
(5681, '6d87d753-61b1-403b-b9cc-1b61abe604ff', 'Die Groot Ontbyt', '\'S2/E128\'. Aktualiteit, nuus, verkeer, weer en natuurlik goeie Afrikaanse musiek. Die span: Johrné van Huyssteen, Elsa Esterhuizen, Hendri Myburgh, Rouchelle Liedemann, Riaan Grobler en Su-an Marais.', NULL, NULL, NULL, NULL, '2', '128', '2017-03-07 16:36:08', '2017-03-07 16:36:08'),
