(5683, '09ffcd21-fa6f-4ce4-8703-73238e6b867c', 'Dee Dee &amp; Spike', '\'S1/E115\'. Dee Dee &amp; Spike is \'n dansreeks vir die jongspan. In elke episode word jy na \'n pret plek weggevoer en speel-speel leer ons jou danspassies en help jou om jou woordeskat te bou.', NULL, NULL, NULL, NULL, '1', '115', '2017-03-07 16:36:08', '2017-03-07 16:36:08'),
