(5687, '3eba7718-61cf-4813-aedc-4869be20f507', 'Sakefokus/Ontbytsake', '\'S3/E782\'. Ontbytsake se verkorte weergawe, fokus spesifiek op klein- en medium sakeondernemings wat \'n verskil maak in ons land se ekonomiese vooruitgang.', NULL, NULL, NULL, NULL, '3', '782', '2017-03-07 16:36:08', '2017-03-07 16:36:08'),
(5688, 'e46e9dfa-947e-45cc-8826-02ca03b21caa', 'Glam Guru', '\'S11/E9\'. Chantelle is \'n enkelouer en al drie jaar enkellopend. Om \'n potensiële lewensmaat te ontmoet moet jy eerstens raakgesien word en daarom het sy Glam Guru se hulp ingeroep.', NULL, NULL, NULL, NULL, '11', '9', '2017-03-07 16:36:08', '2017-03-07 16:36:08'),
(5689, '87e738ef-e018-4a09-8806-e0bd7e646a43', 'Villa Rosa', '\'S11/E2270\'. Daar is spanning tussen Fritz en Lida. Cardo toets die waters by Celine oor \'n gevoelige sakie en Eben beland in die sop. Saskia kom sien die Retiefs en laat bars \'n bom wat niemand verwag het nie.', NULL, NULL, NULL, NULL, '11', '2270', '2017-03-07 16:36:08', '2017-03-07 16:36:08'),
(5690, '60ac8bf0-593b-4648-90a4-be3d2940082a', 'Binnelanders', '\'S5/E1288\'. Binneland Stereo probeer agter die kap van die byl kom oor wat met Daleen gebeur het, en Karli plaas Herman onder kruisverhoor. Steve vra dat At hom uitkoop.', NULL, NULL, NULL, NULL, '5', '1288', '2017-03-07 16:36:08', '2017-03-07 16:36:08'),
(5691, '961b9f58-ba1f-4fc9-a960-fbcc248ec078', 'Suidooster', '\'S2/E242\'. Ian wil veg vir sy huwelik met Bridgette, maar dit lyk of sy finaal op Ismail besluit het. Jerome en Bianca is onseker oor wat presies Carmen se terugkeer beteken.', NULL, NULL, NULL, NULL, '2', '242', '2017-03-07 16:36:08', '2017-03-07 16:36:08'),
(5692, '424ddc51-9e9d-45cf-bc45-8862bfb91a8c', 'BVP: Krieket', '\'S4/E41\'. BVP saam met Vinnige Fanie is \'n krieket-kookpot van gesels, nuus en menings oor plaaslike en internasionale krieket. Saam met krieketkommentator Jeremy Fredericks vat hy die brandpunte in krieket aan.', NULL, NULL, NULL, NULL, '4', '41', '2017-03-07 16:36:08', '2017-03-07 16:36:08'),
(5693, '7f36a055-766b-4aea-a66f-4c3da0b75211', 'SuperRugby', '\'S4/E2\'. Kenners kyk na die jongste ontwikkelinge in die rugby-wêreld. Ateljeegaste neem ook deel aan besprekings en beantwoord kykers se inbelvrae.', NULL, NULL, NULL, NULL, '4', '2', '2017-03-07 16:36:08', '2017-03-07 16:36:08'),
(5694, 'fabd436b-0c72-43ec-92b3-98e6106a5b08', 'Jan Braai Vir Erfenis', '\'S6/E9\'. Jan verwesenlik \'n lewenslange droom, deur in \'n warmlugballon te braai. Die Springbok-kaptein van wynskink, wys vir Jan hoe om wyn te drink en daar word \'n Katemba-beesvleis-potjie gemaak.', NULL, NULL, NULL, NULL, '6', '9', '2017-03-07 16:36:08', '2017-03-07 16:36:08'),
(5695, 'dbc314c1-6041-4fd4-b471-d8e10d0a7a9c', 'Heidi', '\'S1/E46\'. Heidi is \'n weeskind wat by haar oupa moet gaan bly in die Alpe. Die norse oupa word klei in Heidi se hande, ons leer ook vir Peter en die kwaai Juffrou Rottenmaier ken.', NULL, NULL, NULL, NULL, '1', '46', '2017-03-07 16:36:08', '2017-03-07 16:36:08'),
(5696, 'c21572c3-6a82-482a-9ce5-0b766a1e6da3', 'EGOLI - Plek Van Goud', '\'S8/E1935\'. Lojale EGOLI-aanhangers wat vir jare die lief en leed van Johannesburg se sepie-families gevolg het, en \'n hele geslag nuwe kykers wat smag na vroegdag vermaak, kan daagliks hierdie treffer-sepie geniet.', NULL, NULL, NULL, NULL, '8', '1935', '2017-03-07 16:36:08', '2017-03-07 16:36:08'),
(5697, '3f37de1c-41e9-4b7b-baa4-53c6bcdec55d', 'Villa Rosa', '\'S11/E2271\'. Saskia spin haar web al hoe stywer om Liam. Celine is verlig wanneer dinge weer begin goed gaan. Eben en Wouter bereik vrede in hulle vriendskap en dinge neem \'n onverwagse wending wanneer Liam in \'n hoek beland.', NULL, NULL, NULL, NULL, '11', '2271', '2017-03-07 16:36:08', '2017-03-07 16:36:08');
