(5712, 'f0edef2a-631f-49c6-aaf6-45b7cd4a9c9d', 'Die Wasgoedlyn', '\'S1/E4\'. Die twee gromstemme van Afrikaanse musiek, Dozi en Andra hang saam op die wasgoedlyn. Ons kuier by Dozi op sy plaas en Andra vertel ons van haar lewe in Namibië se woestynland.', NULL, NULL, NULL, NULL, '1', '4', '2017-03-07 16:36:10', '2017-03-07 16:36:10'),
