(5714, '89b8b706-131c-4581-9776-6b4494bc12ef', 'Jam: Hoogtepunte Deel 2', '\'S3/E149\'. Hier gesels ons met die room van die Afrikaanse musiekindustrie, maak lekker musiek en deel musieknuus. Ons gaan julle sommer ook op hoogte hou van al die musiekgebeure in die land.', NULL, NULL, NULL, NULL, '3', '149', '2017-03-07 16:36:10', '2017-03-07 16:36:10'),
