(6532, 'bd6026a7-df3f-4c14-91fc-2807340e7f04', 'Caïn', '\'S4/E1 - Les Prisonnières\'. Charlotte et Sylvie Véry, une mère et sa fille, sont kidnappées un matin par un inconnu. Très vite, il apparaît à Caïn que Mathias Véry pourrait être à l\'origine de l\'enlèvement.', NULL, NULL, NULL, NULL, '4', '1', '2017-03-07 16:36:50', '2017-03-07 16:36:50'),
(6533, 'ace2377f-1fc1-445e-b30e-0fefdf727945', 'Caïn', '\'S4/E2 - Le Crépuscule Des Idoles\'. Caïn et Lucie sont amenés à enquêter sur le meurtre particulièrement atroce de Léa, une lycéenne battue à mort. L\'enquête conduit Caïn à soupçonner Etienne Courcelles.', NULL, NULL, NULL, NULL, '4', '2', '2017-03-07 16:36:50', '2017-03-07 16:36:50'),
