(6547, '4692728d-2056-4bf3-9a75-316be497c443', 'Stars Parade', '\'S1\'. En privilégiant les rencontres et les genres, Stars parade permet à la musique africaine de s\'exprimer et de se faire connaître à travers le monde grâce à sa diversité culturelle et à la richesse de ses mélodies.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:36:51', '2017-03-07 16:36:51'),
(6548, '6d574c5b-bf97-42b5-b80f-2fea06307abc', 'Les Bobodiouf Le Retour', '\'S1 - Le Maquis De Fati Et Bala\'. BalaBala et Fati décident d\'ouvrir un petit restaurant. Malheureusement, les choses ne se passent pas comme prévu.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:36:51', '2017-03-07 16:36:51'),
(6549, '2358efeb-e668-4071-adb5-9fe73cf5afbe', 'Plus Belle La Vie', 'Chroniques de la vie quotidienne au Mistral, quartier populaire de Marseille, avec ses joies, ses drames, ses histoires d\'amour et de haine, ses secrets.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:36:51', '2017-03-07 16:36:51'),
(6550, 'a3d5eb24-bde1-4503-a04e-15e88afe4b9e', 'Waga Love', '\'S1 - Amour Interdit\'. Les inscriptions se poursuivent à l\'agence. Comme cette femme qui dit chercher un homme juste pour la féconder. Saaga reçoit des demoiselles aux profils étranges sous le regard interrogateur de Brigitte.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:36:51', '2017-03-07 16:36:51'),
(6551, 'a4cf89d5-e643-4c64-869e-317e5c4efaed', 'TV5MONDE Le Journal', 'Toute l\'actualité nationale et internationale proposée par la rédaction de TV5MONDE.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:36:51', '2017-03-07 16:36:51'),
(6552, '834c3904-1912-41b2-abdb-80800ed1a080', 'Tout Le Monde Veut Prendre Sa Place', '\'S1\'. Le jeu où tout le monde peut devenir champion. Un quiz, six candidats et, bien calé dans son fauteuil, un champion que tous rêvent de déloger! Présenté par Nagui.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:36:51', '2017-03-07 16:36:51'),
(6553, '1330e842-8b64-4ba2-b200-8812a601c28d', 'Ça Roule!', '\'S1 - Un Amour De Coccinelle\'. Au sommaire : Grand format : Juliette est au Bénin. Essai : La Coccinelle et la Toyota Hilux. L\'actu de la semaine : Les perles du NetAuto, moto, camion.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:36:51', '2017-03-07 16:36:51'),
(6554, 'bab03879-1299-4d05-9b8e-618863b6581d', 'S\'Il N\'En Restait Qu\'Une', '\'S15 - Guy Savoy\'. Magicien et épicurien, Guy Savoy parle de sa poêlée de moules, mousserons jus terre et mer, une recette analysée ensuite par Marc Esquerré, du \'Gault et Millau\'.', NULL, NULL, NULL, NULL, NULL, NULL, '2017-03-07 16:36:51', '2017-03-07 16:36:51');
